INSERT INTO `itinerary_master` (`entry_id`, `dest_id`, `special_attraction`, `daywise_program`, `overnight_stay`) VALUES (1,1,'Day-1 Arrive Port Blair-Cellular Jail-Light & Sound Show','On arrive at Port Blair airport, our representative will receive and escorted to the hotel. After check-in at the hotel and little relax, we proceed to covers Cellular Jail (National Memorial), and after Light & Sound Show at Cellular Jail: At evening, we move for the Light and Sound Show at Cellular Jail where the saga of the freedom struggle brought alive.','Port blair'),(2,1,'Day-2 Port Blair-Havelock Island-Radhanagar Beach','Today, we start our journey towards Havelock island via ferry from Port Blair Harbor. On arrival at Havelock Island, our representative will receive and escort you to check-in to the resort. Later we proceed to Radhanagar Beach (Beach No. 7), the Times Magazine rated the finest beach among the best beaches in Asia. It is an ideal place for swimming, sea bathing and basking on the sun kissed beach.','Havelock Island'),(3,1,'Day-3 Havelock Island Sightseeing','After breakfast, day free at Havelock Island for own leisure activities.','Havelock Island'),(4,1,'Day-4 Havelock Island - Neil Island','Today, we start our journey from Havelock island to Neil Island via ferry. On arrival at Neil Island, our representative will receive and escort you to check-in to the Hotel. Then we proceed to visit the sandy beaches at Bharatpur and Lakshmanpur which are very attractive for spending holidays. Tourists who like to spend vacations in an eco-friendly locale will find this Island ideal.','Havelock Island'),(5,1,'Day-5 Travel from Havelock to Port blair. Later visit Chadiatapu sunset','Return back from the amazing experience of Havelock Island to Port Blair. On arrival in Port Blair our representative attends you and drops you to your hotel. Later we proceed to visit Andaman Islands best sunset point, Chidiatapu. Chidiatapu is an amazing destination for bird watching and sunset.','Port blair'),(6,1,'Day-6 Travel from Port blair to Diglipur Island','Depart from Port Blair to Diglipur Island by road through the dense tropical forest and Jarawa Tribal reserve. Often you might see a member of the Jarawa Tribe while passing through the tribal reserve. On your journey you will take the route of Andaman Grand Trunk road passing through Baratang Island, Rangat & Mayabunder. Reach Diglipur, and check into the hotel for overnight stay. During this trip also experience the lifeline of the Andaman Islands, Vehicle Ferry that carries vehicles from one island to the other.','Diglipur'),(7,1,'Day-7 Trip to Ross and Smith Island. Also visit arial bay beach','This day we visit the heart of Diglipur, Ross and Smith Island. 2 Islands separated by a Sand bar is a treat to see and experience. Your journey begins from Arial Bay Jetty by boat. By boat to reach the twin Island. Virgin beaches on this island is a treat to experience. Spend your day enjoying the turquoise water and walk on the Sand bar that adjoins both Ross and Smith Island. We then return back from this trip and visit Aerial bay beach that is one among the turtle nesting grounds in Diglipur.','Diglipur'),(8,1,'Day-8 Turtle nesting ground. Later diglipur to Rangat','Today, we begin our journey to a Turtle nesting ground, Ramnagar Beach. This beach is consistently visited by Olive Ridleys turtles to hatch eggs. The support staff in this destination helps these turtles to protect the laid eggs and to help the young turtles take their first swim in the open waters. Get a chance to experience this during your trip to Ramnagar beach. Later return back from Diglipur to Baratang Island.','Rangat'),(9,1,'Day-9 Neil Island-Port Blair-City Sightseeing -Shopping','After breakfast we start our journey towards Port Blair via ferry from Neil Island. Afternoon we take you for the tour of Port Blair city which covers Samundrika (Naval Marine Museum), Anthropological Museum, which displays the tools, models habitats, art and handcrafts of the aboriginal tribes of Andaman & Nicobar Islands.','Port Blair'),(10,1,'Day-10 Port Blair-Ross Island-North Bay Island (Coral Island)','Today, after breakfast we will proceed for a full day cruising towards Ross Island, & North Bay(Coral Island)\nRoss Island: First we starts the exhilarating journey to Ross Island the erstwhile capital of Port Blair during the British regime, it now stands an imposing relic, with the structure almost in debris. A small museum displays photographs and other antiques of the Britishers, relevant to these islands.','Coral Island'),(11,1,'Day-11 Joyful trip to North Bay island','North Bay (Coral Island): From Ross Island, we proceed for a joyful trip to North Bay island (Coral Island) offering exotic coral, colorful fishes and underwater marine life. We can view these colorful corals & underwater marine life via in glass bottom boat and Snorkeling (optional).','North Bay island'),(12,1,'Day-12 Day at Leisure. We do nothing-We Just relax.','Day at leisure. How, about relaxing in the lap of nature? Today, you can relax and spend the day enjoying white sand beaches. Additional activities such as Scuba Diving and Sea Walk can be done on this day.','Port blair'),(13,1,'Day-13 Depart from Port Blair Islands','Drop to Port Blair for Return journey.','Tour Ends'),(14,5,'Day-1 Arrival Ahmedabad','Arrive Ahmedabad early morning. Proceed to Hotel, Later visit Sabarmati Aashram, Akshardham Temple.','Ahmedabad'),(15,5,'Day-2 Ahmedabad-Dwarka','After breakfast proceed to Dwarka. Overnight stay at Dwarka.','Dwarka'),(16,5,'Day-3 Dwarka Temple sightseeing','After breakfast visit Dwarkadheesh Temple, Rukmmini Temple. After lunch Take ferry to Bet Dwarka (Island) Original Dwarka,Nageshwar Temple. Overnight stay at Dwarka.','Dwarka'),(17,5,'Day-4 Travel Dwarka-Somnath','After breakfast proceed to Somnath. After refreshment go for Somnath Darshan, then visit Bhallaktirth, Dehotsarg and Prabhas Patan.','Somnath'),(18,5,'Day-5 Somnath-Gir-Junagarh','After breakfast proceed to Junagarh, on the way visit Gir Forest.','Junagarh'),(19,5,'Day-6 Junagarh-Girnar-Junagarh','Today visit Girnar Parvat in morning. Later visit Ashok Shaila-lehk, Uparkot Fort.','Junagarh'),(20,5,'Day-7 Junagarh-Vearval','After breakfast proceed Veraval Airport/Railway station.','Tour Ends'),(21,5,'Day-8 Ahmedabad to Barods','After breakfast check out from hotel and drive to Baroda. Proceed for Darshan to Shree Ranchhodraiji Temple at Dakor and then transfer to Baroda. Check in to your hotel. Then visit Baroda Sayaji Baugh and Museum.','Baroda'),(22,5,'Day-9 Day Tour to tatue Of Unity','After breakfast we go for day trip from Baroda. First we visit Neelkath Dham, Kuber Bhandari Mahadev and Narmada River Darshan and later transfer for lunch at Rajpipda Village. After lunch we visit Rajwant Palace Museum and later transfer to Visit Statue of Unity, Shree Sardar Vallabh Bhai Patel\'s 182Meter tall Statue -the world\'s tallest statue. We also enjoy Laser Show and later transfer to Baroda.','Baroda'),(23,5,'Day-10 Baroda to Ahmedabad','After breakfast check out from Hotel and visit Laxmi Vilas Palace and later transfer to Ahmedabad, as per time we visit Hathi Singh Jain Temple, Vintage Car museum, Siddi Saiyad Mosque, and now its time to say good bye and drop at Railway Station / Airport.','Tour Ends'),(24,5,'Day-11 Baroda to Ahmedabad Airport','After breakfast check out from Hotel its time to say good bye and drop at Railway Station / Airport.','Tour Ends'),(25,6,'Day-1 Arrival Chandigarh Airport','Arrival at Chandigarh Airport. Drive you to Shimla. On reaching Shimla check into your hotel. Evening Proceed for local sightseeing in and around Shimla such as the ridge to walk along the Mall, Lakkar Bazaar, Jakhoo Hill, St. Michaels Cathedral, State Museum, Kali bari Temple, Hanuman Temple.','Shimla'),(26,6,'Day-2 Shimla Local Sightseeing','Local Sightseeing After breakfast proceed for wonderful day excursion to Kufri. In Kufri enjoy a walk through thick cedar woods to Mahasu Pick for amazing view of mighty Himalayas. You can do wonderful photography also. Evening do some shopping at very famous Mall road of Shimla. ','Shimla'),(27,6,'Day-3 Travel Shimla to Manali','After having breakfast transfer to Manali. on the way, you can view beautiful flora of nature. On reaching Manali check into your Hotel.','Manali'),(28,6,'Day-4 Manali Local Sightseeing','After breakfast proceed for full day local sightseeing of Manali like Hadimba Temple, Tibetan Monastery, Lord Buddha and Tankha paintings, Vashistha Temple for Hot & Cold water Kund, Club House. The evening is free leisure & you can move around to the Mall Road for shopping.','Manali'),(29,6,'Day-5 Manali - Rohtang Pass','After breakfast proceed on a day excursion to the Rohtang Pass also called Snow Point of Himachal-enjoy the beauty of year around snow caped mountains. Guests enjoy Skiing experience. On the way, back visit Solang Valley, hub of adventure sports in Manali such as Paragliding, Zorbing etc. Solang Valley turns into a Ski resort in Winter. The rest of the day is free to explore this picturesque town on your own','Manali'),(30,6,'Day-6 Manali- Atal Tunnel- Manali','After breakfast visit Atal tunnel after that visit Mall Road, overnight at Hotel.','Manali'),(31,6,'Day-7 Manali to Dharamshala','After breakfast, travel to Dharamshala- on the way stopping at Baijnath known for its Shiva Temple and further at Palampur famous For Tea Garden. Dharamhsala is a hill-station lying on the spur of the Dhauladhar Mountains about 18 kms north-east of Kangra, It is known for its scenic beauty set amidst high pine and oak trees.','Dharamshala'),(32,6,'Day-8 Dharamshala To Dalhousie','After Breakfast drive from Dharamshala towards Dalhousie after doing the local sightseeing of Places which includes, His holiness Dalai lama residence at Mc Leodgunj, War memorial, Bhagsunath temple and Dal Lake.','Dalhousie'),(33,6,'Day-9 Dharmshala-Manali (215 Kms)','After breakfast, leave for Manali, Reach Manali by evening. En route visit Kullu Valley & Kullu Shawl factory, check in hotel.','Manali'),(34,6,'Day-10 Dalhousie to Khajjiar','After Breakfast local sightseeing of Dalhousie includes visit to Panjipula, Subhash Baoli and excursion to Khajjiar. Surrounded by varied vegetation, pines, dodders, oaks and flowering rhododendron.from Dalhousie surrounded by thick Deodar forest. Drive from Dalhousie to Khajjiar is awesome.','Khajjiar'),(35,6,'Day-11 Dalhousie to Delhi','After breakfast proceed to Delhi airport for your onward journey','Tour End'),(36,6,'Day-12 Manali - Chandigarh','After taking breakfast proceed to Chandigarh (275 kms / 9 Hrs). on reaching at Chandigarh you can visit Sukhna lake and enjoy boating there later check into your hotel. Enjoy your Dinner.','Chandigarh'),(37,6,'Day-13 Dalhousie to Chandigarh','After breakfast you check out the hotel and proceed for city tour, Start with Rock Garden which consists of various arts and objects made of industrial and urban waste. Later proceed for Delhi Airport to Catch the Flight for back to home with sweet memories.','Tour End'),(38,6,'Day-14 Shimla-Chandigarh (129 Kms)','Early Morning after breakfast check out Hotel drive to Chandigarh en route visit Rock garden,Pinjore Garden. In the evening at Sukhana Lake check in hotel','Chandigarh'),(39,6,'Day-15 Chandigarh-Home Town','Early Mornning after breakfast check out hotel transfer to Airport.','Tour End'),(40,8,'Day-1 Arrive at Bangalore','On arrival, transfer to the hotel, later visit Lalbagh, Vidana Soudha, Museum and ISKON temple.','Bangalore'),(41,8,'Day-2 Drive to Mysore','After breakfast, check-out and proceed to Mysore. Enroute visit Srirangapatna (Dariya Daulat Bagh, Gumbaz, Tippu Fort and Ranganathaswamy Temple). Check in to Hotel on arrival. Evening proceed to Brindavan Gardens.','Mysore'),(42,8,'Day-3 Mysore sightseeing','After breakfast, proceed for a city tour in which we will see Maharaja\'s Palace, Chamundi Hill, Big Bull, St. Philomena\'s Church, Jagan Mohan Palace(Art Gallery) and Zoo.','Mysore'),(43,8,'Day-4 Drive to Ooty','After breakfast checkout and proceed to Ooty, on arrival in Ooty check-in to a hotel. Later visit Ooty lake, Botanical Gardens.','Ooty'),(44,8,'Day-5 Ooty sightseeing','After breakfast, proceed to Coonoor. Where we will see Sim\'s Park\' lam\'s Rock, Dolphin Nose, Tea factory and tea Gardens. We can also visit Doddabetta Peak.','Ooty'),(45,8,'Day-6 Drive to Kodaikanal','After morning breakfast checkout and proceed to Kodaikanal. Check in to hotel on arrival. In the evening visit Cookers walk, Green valley view, and the Lake.','Kodaikanal'),(46,8,'Day-7 Kodaikanal','After morning breakfast, proceed to visit Pillar\'s Rocks, Silent Valley View, Silver cascade falls.','Kodaikanal'),(47,8,'Day-8 Kodaikanal to Bangalore Airport','After breakfast checkout and proceed to Bangalore to board your flight.','Tour Ends'),(48,8,'Day-9 Kodaikanal to Coimbatore Airport','After breakfast checkout and proceed to Coimbatore to board your flight.','Tour Ends'),(49,7,'Day-1 Arrival at Srinagar','On arrival at Srinagar Airport you will meet to our representative and transfer you to Houseboat. In the evening enjoy Boat ride \'Shikara\' around Dal Lake (By own/included).','Houseboat/Srinagar'),(50,7,'Day-2 Srinagar to Pahalgam ','After breakfast leave from Srinagar and drive to Pahalgam (Vale of Kashmir). Pahalgam is the most famous place for Film industry.','Pahalgam'),(51,7,'Day-3 Pahalgam local sightseeing','Full day enjoyment in Pahalgam.','Pahalgam'),(52,7,'Day-4 Pahalgam to Gulmarg','After breakfast leave from Pahalgam and drive to Gulmarg. In the way visit saffron fields and en-route Avanti Raja\'s ruined Palace You can enjoy a pony ride and also enjoy a Gondola ride (cable car)(by own) to Khilanmarg. Evening is free to explore the charm & natural beauty of Gulmarg Valley, \', in the evening return to Srinagar.','Gulmarg'),(53,7,'Day-5 Gulmarg to Srinagar','After breakfast leave from Gulmarg and drive to Srinagar, After fresh up leave for Mughal Gardens Nishat, Shalimar & Shankaracharya.','Srinagar'),(54,7,'Day-6 Srinagar - Sonamarg - Srinagar','After breakfast leave from Srinagar and drive to Sonamarg, full day excursion to Sonamarg. Sonamarg is known as \'Gateway of Ladakh\', in the evening return to Srinagar.','Srinagar'),(55,7,'Day-7 Pahalgam to Katra','After breakfast transfer to Katra. Evening arrive at Katra. Check in to hotel. Evening free for Shopping.','Katra'),(56,7,'Day-8 Mata Vaishnodevi Darshan','Early morning start for trek of Mata Vaishnodevi. Evening back to hotel from Darshan.','Katra'),(57,7,'Day-9 Katra Jammu drop','After breakfast transfer to Jammu Airport.','Tour End'),(58,9,'Day-1 Arrive Cochin & local sightseeing','Morning pick up from Cochin Airport/Station, later transfer to Hotel, check in and proceed for Local Kochi Sightseeing-Visit Chinese Fishing Net, Portuguese Synagogue, Mattancherry Spice Market, Bolgatti Palace.','Cochin'),(59,9,'Day-2 Arrive Cochin & overnight stay','Morning pick up from Cochin Airport/Station, later transfer to Hotel, check in the hotel.','Cochin'),(60,9,'Day-3 Cochin to Munnar travel','In the morning after breakfast, check out from hotel, and proceed towards Munnar, this is called as \'nature lover\'s Paradise\' with sprawling tea plantations. On arrival here, check in to the Hotel. In the evening proceed to Mettupatty dam, visit Echo point & shooting point.','Munnar'),(61,9,'Day-4 Munnar local sightseeing','After breakfast, proceed for Munnar local sightseeing, covering Mattupetty dam, Eco Point, On the way take photo stop at tea Plantation. The we will visit Tea Museum.','Munnar'),(62,9,'Day-5 Munnar to Thekkady','After breakfast check out, proceed to Periyar. A scenic Journey past mist capped mountains, spice plantations and open grasslands lined with Spectacular Water falls & delightful trekking trails form the access to your hide way here. On arrival check into Hotel. In the afternoon take a boat tour in Periyar Lake. Later in the evening you can enjoy Kathakali show (at extra cost).','Thekkady'),(63,9,'Day-6 Thekkady to Alleppey','After Breakfast check out and visit to Spice Garden, where you can purchase spices for yourself. Later Proceed to Alleppey/Kumarakom, on arrival check in to the Hotel. Later on you may proceed to enjoy Backwater ride. (At extra cost).','Alleppey'),(64,9,'Day-7 Alleppey to Kanyakumari ','Early Morning after Breakfast Start for Full day Kanyakumari, same day Arrival, visit Vivekananda Memorial, Amman Temple, Evening Enjoy Sunset, Afterwards Start back to Hotel.','Kanyakumari'),(65,9,'Day-8 Kanyakumari to Trivandrum/Kovalam','Morning breakfast at hotel and drive to Trivandrum. Enroute you can visit Sucheendram Temple. On arrival transfer to hotel, check in. Evening spend time on beautiful Kovalam Beach. Night halt at Trivandrum/Kovalam.','Trivandrum'),(66,9,'Day-9  Trivandrum/Kovalam local sightseeing','Morning breakfast at hotel. Leave for city tour of Trivandrum visiting the ancient Temple of Sri Padmanabhaswamy is one of the major attractions in the city of Thiruvananthapuram and also visit Napier museum, Sri Chitra Art Gallery and Botanical Gardens. Evening at leisure.','Trivandrum'),(67,9,'Day-10 Trivandrum airport drop','Morning after Breakfast Check out Hotel, later depart to Trivandrum Airport, drop at Airport.','Tour Ends'),(68,10,'Day-1 Kanha National Park','Transfer to Kanha National Park. Kanha\'s Sal and bamboo forests, rolling grasslands and meandering streams stretch over 940 sq km in dramatic natural splendor which form the core of the Kanha Tiger Reserve created in 1974 under Project Tiger arrive at Kanha Free time for relaxation.','Kanha'),(69,10,'Day-2 Kanha National Park Safari','Early morning proceed to Kanha Wild Life Safari. Expect encounter with exotic creatures of the jungle. After lunch free time for relaxation.\nSafari Timing -6:00 Am & 2:00 Pm','Kanha'),(70,10,'Day-3 Travel Kanha-Jabalpur','After breakfast check out hotel & drive to Jabalpur. En route visit Beda Ghat (famous for marble rocks), and Dhuwadhar Waterfalls. Check in to the hotel & free time for relaxation.','Jabalpur'),(71,10,'Day-4 Jabalpur -Panchmarhi','After breakfast check out hotel & drive to Panchimarhi check in the hotel & free time for relaxation.','Panchamarhi'),(72,10,'Day-5 Panchamarhi local sightseeing','After breakfast, proceed for Panchmarhi Sightseeings. Visit Pandav Caves, Handi Kho, Priyadarshani Valley, Gupt Mahadeo Mandir and Bada Mahadev Mandir. After visit Jatashankar Temple and Sunset point (Rajendra Giri).','Panchamarhi'),(73,10,'Day-6 Panchamarhi','After breakfast check out from the hotel & drive to Airport for your onward journey with a life time memories.','Tour Ends'),(74,13,'Day-1 Jaipur arrival','Arrive in Jaipur. Proceed to enjoy a half day sightseeing tour of Jaipur. Visit the City palace and local market etc','Jaipur'),(75,13,'Day-2 Arrival Mount Abu','Arrive at Mt.Abu Road station,Enjoy the unique experience of Sunset.','Mount Abu'),(76,13,'Day-3 Mount Abu City Tour','After breakfast full day city tour includes Dilwara temple, The sun set point, Prajapita Bramhakumari Ashram and University-\'The impartation of Spiritual knowledge and meditation and picturesque Nakki Lake','Mount Abu'),(77,13,'Day-4 Travel Mount Abu to Udaipur','After breakfas, drive toward the Udaipur on the way Visit to famous jain temples of Ranakpur, later visit haldighati maharana pratap museum.','Udaipur'),(78,13,'Day-5 Udaipur local sightseeing','After breakfast,Later start to city sight seeing tour of Udaipur.Visit the City Palace museum, Saheliyo ko badi, Bhartiya Lok Kala Mandir ( Folk art museum) and the Pratap Memorial. Rest of the day at leisure.','Udaipur'),(79,13,'Day-6 Travel Udaipur-Chittorgarh-Ajmer-Pushkar','After breakfast, drive toward to Ajmer and Enroute visit Chittorgarh Fort -Ranakumbha, Meera mandir, Vijay stambha and Padmini\'s palace. Arrive at Ajmer and visit Dargah Shariff, at Ajmer.','Pushkar'),(80,13,'Day-7 Pushkar-Jaipur','After breakfast, proceed to Jaipur. Enroute visit Bramha mandir and Pushkar lake, Arrive at Jaipur. Transfer to hotel.','Jaipur'),(81,13,'Day-8 Jaipur city sightseeing','Today after breakfast enjoy a full day sightseeing tour of Jaipur. Visit Amer Fort, Hawa Mahal, Jantar Mantar, City Palace, Museum, Govinddev Temple and Jalmahal.','Jaipur'),(82,13,'Day-9 Travel Jaipur to Bikaner','After breakfast drive to Bikaner. Upon arrival, check in to the hotel. In the evening visit a Camel breeding farm and the world famous Karni Mata Temple, also known as Deshnok Temple. Evening is at leisure.','Bikaner'),(83,13,'Day-10 Travel Bikaner to Jaisalmer','After breakfast visit Junagarh fort. Later proceed to Jaisalmer - \'The Golden City\' of Rajasthan. Jaisalmer is famous for its yellow sandstone structures, dusky landscape and romantic sand dunes. Jaisalmer was the window of the Thar, connecting India to Central Asia, Persia, Egypt and the west, thus making the city a cultural cauldron.','Jaisalmer'),(84,13,'Day-11 Jaisalmer sightseeing & Desert safari','After breakfast, visit the Golden Fort of Jaisalmer, Patwon Ki Haveli\'s and Salim Singh ki Haveli. See the manmade Gadsisar lake and the royal cenotaphs at Bada Bagh. In the evening experience camel safari in the rolling sand dunes and enjoy dinner.','Jaisalmer'),(85,13,'Day-12 Travel Jaisalmer to Jodhpur','After an early breakfast, proceed to Jodhpur. Upon arrival check in at the hotel. In the afternoon enjoy Jodhpur sightseeing. Visiting the best preserved fort of Rajasthan -the Mehrangarh fort. Later see the marble cenotaph at Jaswant Thada.','Jodhpur'),(86,13,'Day-13 Jodhpur Local sightseeing','After breakfast leave for Jodhpur local-Jodhpur-the stronghold of the fierce Rathore clan, was founded in 1459 by Prince Jodha. Visit the Mehrangarh Fort, situated on a low sandstone hill. Within the fort, visit Moti Mahal and Phool Mahal and Umaid Bhavan Palace.','Jodhpur'),(87,13,'Day-14 Jodhpur Ajmer/Pushkar','After breakfast checkout from the hotel and visit Umaid Bhawan Palace and vintage car museum. Then proceed to Pushkar. Upon arrival check in at hotel. In the afternoon enjoy the sightseeing of Pushkar visiting Lord Bramha Temple, Holy Lake Pushkar and thr local colourful market.','Pushkar'),(88,13,'Day-15 Pushkar Jodhpur Departure','After breakfast checkout from the hotel and visit the Ana sagar lake and Dargah. Later transfer to railway station / Airport at Jaipur for your onwards destination. Return home with eternal memories of you tour with Mango Holidays!','Tour End'),(89,14,'Day-1 Arrival at Bagdogra','Arrival at Bagdogra / New Jalpaiguri-to Darjeeling. Check out from the hotel.','Bagdogra'),(90,14,'Day-2  Tiger Hil, Ghoom Monastery,Padmaja N. Zoological Garden','Early morning proceed to Tiger Hill to watch the spectacular sunrise and its amazing effects on the Mt. Kanchendzonga, \nVisit Ghoom Monastery and Batashia Loop War Memorial while returning to the Hotel. Breakfast at the Hotel followed by half day local Best points sightseeing. Visit Padmaja N. Zoological Garden Himalayan Mountaineering Institute, Tibetan Refugee Self-help Center, Ropeway. Evening visit Mall and Local Market for shopping & individual activity.','sikkim'),(91,14,'Day-3 Trip to Tsomgo Lake Baba Mandir Meals','After breakfast Excursion Trip to Tsomgo Lake Baba MandirMeals. Evening free for individual activity and leisure.','sikkim'),(92,14,'Day-4 Travel to Gangtok to LachungMeals','After breakfast proceed to Gangtok to LachungMeals, Visit Chortan( Stupa) Institute of Tibetology, Institute of Handicrafts and handlooms, Ranka Monastery & Jakhri water falls.','sikkim'),(93,14,'Day-5 Travel to  Yumthang Valley Meals','After breakfast proceed to Yumthang ValleyMeals. Day trip to Tsomgo lake ,32kms from Gangtok City. Evening free at Gangtok for shopping and individual activity.','sikkim'),(94,14,'Day-6 Travel to airport','After breakfast proceed to GangtokMeals Transfer to Bagdogra Airport / New Jalpaiguri Railway Station. Tour with sweet memories.','Tour Ends'),(95,15,'Day-1 Arrive Madurai','Arrive Madurai Railway Station/Airport. Report to our representative & transfer to hotel. Evening visit Meenakshi Temple. Evening free time for Shopping.','Madurai'),(96,15,'Day-2 Travel Madurai-Tiruchirappalli-Thanjavur','After breakfast check out from hotel & proceed to Tiruchirappalli- formerly called Trichinopoly in English, nicknamed Tiruchi. On arrival visit Srirangam Temple of Lord Vishnu. After Lunch proceed to Thanjavur.','Thanjavur'),(97,15,'Day-3 Thanjavur local sightseeing','After breakfast proceed to visit Thanjavur local sightseeing. Visit Brihadeshwara Temple of Shiva the famous temple in Tanjore, Thanjavur Fort -Sivaganga Tank, The Palace, Art Gallery, Royal Museum & Serfoji Memorial Hall. In the evening free time for leisure.','Thanjavur'),(98,15,'Day-4 Thanjavur Vellore','After early breakfast check out from hotel & proceed to Vellore. On arrival visit Vellore Fort, Fort Museum, Jalakandeswarar Temple. After visit check-in at hotel.','Vellore'),(99,15,'Day-5 Vellore-Kanchipuram-Mahabalipuram','After breakfast check out from hotel & visit Vellore Golden Temple. After visit proceed to Kanchipuram. On arrival visit Kanchi Kamakshi Temple & Shankaracharya Math. In the evening proceed to Mahabalipuram On arrival check-in at hotel.','Mahabalipuram'),(100,15,'Day-6 Mahabalipuram-Chennai','After breakfast check out from hotel & visit Group of Monuments-Shore Temples, Krishna\'s Butter Ball, Rock cut Mandapam, Panch Ratha. After lunch proceed to Chennai. On arrival drop at Chennai Airport /Railway station to board your flight/train to your hometown.','Tour Ends'),(101,15,'Day-7 Departure from Chennai airport','After breakfast check out from hotel & drop at Chennai Airport /Railway station to board your flight/train to your hometown.','Tour Ends'),(102,17,'Day-1 Delhi - Mussoorie','Welcome Greetings on arrival at Delhi or Dehradun airport and transfer to Mussoorie known as queen of hill station. Evening reached and check in to hotel and night stay.','Mussoorie'),(103,17,'Day-2 Mussoorie Sightseeing','Breakfast and get ready to visit Kempty Falls-it offers a mesmerising panoramic view as the water falls from the mountains, , Company garden, Mussoorie lake, Later we enjoy Ropeway Ride at Gun Hill point on direct payment which is a favourite place for viewing picturesque Himalayan range. At Gun Hill point you can photograph yourself in a Pahadi outfit.','Mussoorie'),(104,17,'Day-3 Rishikesh to Haridwar','Breakfast and proceed to Haridwar via Rishikesh where you can enjoy rafting on direct payment, Parmarth ashram, Laxman jhula visit and evening participate in Ganga aarti and Night stay.','Haridwar'),(105,17,'Day-4 Travel to Corbett national park','Breakfast and take holy bath at Ganga at Har ki Pauri and proceed to visit Mansa devi temple by cable car on direct payment, after that drive to Wildlife destination Corbett national park. Evening reached and night stay.','Corbett'),(106,17,'Day-5 Nainital Safari','Early morning proceed to safari and after that visit Garjiya temple and Corbett fall and museum and drive to Nainital, queen of Lake in Uttarakhand.','Nainital'),(107,17,'Day-6 Nainital Sightseeing','Breakfast and proceed to Naina devi Temple darshan, Cable car on direct payment to experience snow view point which offers a panoramic view of the mighty Himalayas. Later we see Raj Bhawan - The Governor\'s House, followed by a visit to Hanumangarhi temple - one of the most popular temples of Lord Hanuman and Chidiyaghar Zoo - a high altitude zoo situated in Nainital. In the evening we experience boat ride on direct payment at Naini Lake, followed by free time for shopping at Nainital\'s beautiful Mall road.','Nainital'),(108,17,'Day-7 Departure','Breakfast and proceed to Delhi airport journey after completing memorable uttarakhand trip.','Tour Ends'),(109,17,'Day-8 Delhi to Haridwar','On arrival at Delhi airport / Railway station & drive to Haridwar check in Hotel evening visit Hari Ki Pairi for Ganga Aarti.','Haridhwar'),(110,17,'Day-9 Haridwar-Rishikesh-Mussoorie','Morning after breakfast check out Hotel drive to Mussoorie enroute visit Kankhal,Bharat Mata Temple, Geeta Bhavan and Laxman Zhulla at Rishikesh check in Hotel. Evening free for leisure O/N stay at Mussoorie.','Mussoorie'),(111,17,'Day-10 Mussoorie Local Sightseeing','After Breakfast Visit Kempty Falls. Enjoy Rope way ride, Gunhill point and Kulri market in the evening. Photograph yourself in pahadi outfit at Gunhill point. O/N stay at Mussoorie.','Mussoorie'),(112,17,'Day-11 Mussoorie-Corbett Park','After breakfast, check out Hotel drive to Jim Corbett National Park. Corbett Park is famous for its wild population of tigers, leopards and elephants.','Corbett'),(113,17,'Day-12 Corbett Local sightseeing','Early morning proceed for a Jungle Safari in the National Park, wherein you may encounter wildlife within the Jungle like Tiger, Elephant, Wild Boar, Deer, Peacock, Jackals, and Leopards etc.','Corbett'),(114,17,'Day-13 Corbett Park-Nainital','After breakfast check out hotel and proceed to Nainital. En-route visit Ranikhet check in Hotel evening enjoy boating at Naini Lake and visit Nainadevi Temple. Free time for shopping.','Nainital'),(115,17,'Day-14 Nainital-Delhi-Home Town','Early Morning after breakfast check out hotel & transfer to Railway station/Airport for your onward journey with a life time memories.','Tour Ends'),(116,41,'Day-1 Arrive Hyderabad','Pick up from Airport or station Proceed to Hotel after freshen up, Visit Salarjung Museum houses part of the huge collection of Nawab Salarjung 3rd a Nizam\'s prime minister, Husain Sagar Lake to visit Granite Rock Statue of Buddha, Lumbini Park, Lasers show, NTR Garden, and overnight stay at the respective hotel Hyderabad.','Hyderabad'),(117,41,'Day-2 Hyderabad local sightseeing','After Breakfast visit Golconda Fort is one of the most wonderful monuments, located 11 km. from Hyderabad, Snow World- India\'s biggest first snow fall theme Park, Birla Mandir is a Hindu Temple of Lord Venkateshwara, built entirely of white marble.','Hyderabad'),(118,41,'Day-3 Hyderabad local sightseeing','After Breakfast Visit The Nehru Zoological Park, also known as the Hyderabad Zoo, is one of the largest zoos in India, Sudha Car Museum which is the first and only handmade Wacky Car museum, Chowmahalla Palace which was the official residence of the Nizams of Hyderabad while they ruled their state and this palace was built by Nizam Salabat Jung, and Shopping at Laad Bazar.','Hyderabad'),(119,41,'Day-4 Hyderabad to Sri Sailyam','Morning after breakfast checkout hotel and depart for Sri Sailyam, afternoon arrival & transfer to hotel-later visit: Mallikarjuna Swamy temple','Sailyam'),(120,41,'Day-5 Travel Sri Sailyam to Nagarjunasagar','After breakfast checkout hotel, visit: other local temples Paladara / Panchadara, Sakshi Ganapati, Sikharam, Dam and depart for Nagarjunasagar, evening transfer to hotel.','Nagarjunasagar'),(121,41,'Day-6 Travel Nagarjunasagar to Hyderabad','After breakfast visit: Nagarjunakonda island museum, Anupu, Ettipotala waterfalls & depart for Hyderabad. Evening drop at station /Airport.','Tour Ends'),(122,30,'Day-1 Arrive Kathmandu','Arrival at Kathmandu International airport. Meet & welcome by our representative & transfer to hotel.','Kathmandu'),(123,30,'Day-2 Local sightseeing of Kathmandu','Proceed for the full-day sightseeing tour to Kathmandu valley covering Pashupatinath temple- holiest and oldest Hindu temple, Boudhanath stupa- one of the biggest stupa of the world and Swoyambhunath stupa known as monkey temple- oldest Buddhist stupa situated on a hillock overlooking Kathmandu valley and eastern Himalayan ranges. ','Kathmandu'),(124,30,'Day-3 Drive Kathmandu to Nagarkot','Return & checkout from the hotel and drive for Nagarkot. En-route visit Bhaktapur Durbar square- the finest durbar square of the valley where one can visit golden gate, Palace of 55 windows, Nyatapole temple etc. Finally arrive Nagarkot and check into the hotel. Evening enjoy golden panoramic view of eastern Himalaya with sunset. Overnight in Nagarkot.','Nagarkot'),(125,30,'Day-4 Nagarkot to Kurintar','Enjoy early morning sunrise view. After breakfast proceeds for Kurintar. Check in to the hotel. You can visit Manakamanna temple by cable car on your own.','Kurintar'),(126,30,'Day-5 Kurintar to Pokhara','After breakfast drive to Pokhara observing the scenic views on the national highway along the Trishuli River. Upon arrival, check into the hotel. Evening walk around the tourist area of Lake Side and enjoy the view of western Himalayan ranges with Mt Fishtail.','Pokhara'),(127,30,'Day-6 Pokhara Tour','Wake up early to witness the breathtaking sunrise and Himalayan view from your hotel rooftop. After breakfast, leave for sightseeing tour of Pokhara valley covering Davis Fall, Tibetan Refugee Camp, Seti gorge &Fewa Lake with1 hour boat ride on Lake Fewa. Rest of the day visit around Lake areas.','Pokhara'),(128,30,'Day-7 Drive Pokhara to Chitawan','After breakfast, check-out and drive to Chitawan National Park. Proceed for jungle activities.','Chitawan'),(129,30,'Day-8 Chitawan Safari Activities','Breakfast & start jungle safari on Elephant back to see different kinds of deer, rhinoceros, wild boar, leopard, monkeys, birds and many other smaller animals. After elephant back safari tour proceed for Dugout Canoe Ride along with Dungre / Raptiriver to see 2 type of rare species of crocodile. Visit elephant breeding farm & drive back to the lodge. Late afternoon Village walk can be organized nearby Tharu village. Walk / drive back to the lodge/resort. Evening enjoy \'Tharu Tribal Dance\' presented by the local Tharu villagers.','Chitawan'),(130,30,'Day-9 Drive Chitawan to Kathmandu','After breakfast , check-out and drive back to Kathmandu. Arrive Kathmandu and check into hotel. Rest of the day is free to explore your own.','Kathmandu'),(131,30,'Day-10 Departure from Kathmandu','Breakfast & check out from hotel. Timely transfer to the airport for flight to your onward destination.','Tour Ends'),(132,40,'Day-1 Paro Airport- Thimphu','Meet & Greet on arrival at Paro Airport and transfer to Thimphu (7,710 ft.) the capital city of Bhutan. On arrival check in at the hotel. Evening explore the Thimpu town by walk','Thimphu'),(133,40,'Day-2 Arrival at Bagdogara Airport proceed to Phuentsholing','On arrival at Bagdogara Airport & proceed to Phuentsholing. Check in at Hotel.','Phuentsholing'),(134,40,'Day-3 Phuentsholing to Thimphu','After breakfast, complete the immigration formalities and proceed to Thimphu (7,710 ft.) -The capital city of Bhutan. On arrival check in to hotel.','Thimphu'),(135,40,'Day-4 Travel Thimphu - Punakha','Post breakfast take the transfer to Punakha / Wangdue Phodrong via Do-Chula Pass (10000 ft). Check-in to your hotel on arrival. Post lunch local tour including visit to Punakha Dzong and the confluence of Po chu & Mo chu.','Punakha'),(136,40,'Day-5 Transfer from Punakha-Paro','After breakfast take the transfer to Paro. Check-in to your hotel on arrival.','Paro'),(137,40,'Day-6 Paro Local Sightseeing','Post breakfast embark on a full day local sightseeing tour of Paro covering Drugyel Dzong, Paro Dzong, Taksthang Monastery (also known as Tiger Nest) view point.','Paro'),(138,40,'Day-7 Paro to Phuentsholing','After breakfast, visit Kyichu Monastery & proceed to Phuentsholing. On arrival check in at hotel. Evening free time for leisure.','Phuentsholing'),(139,40,'Day-8 Thimphu Local Sightseeing','After breakfast visit Kuensel Phodrang (Buddha Statue) a place for refreshing with a huge statue of Buddha on the top of the Kuensel Phodrang, National Memorial Chorten (Monument) & Folk Heritage Museum. Afternoon visit Sangaygang View Point, Changangkha Monastery, Takin Preserve Centre, the national animal of Bhutan can be seen here. In the evening visit Tashichho Dzong (Fortress of the Glorious Religion).','Thimphu'),(140,40,'Day-9 Thimphu- Punakha/Wangdue Sightseeing','After breakfast drive to Punakha. Arrival at Punakha check in at hotel. Visit Punakha Dzong - built in 1637 by Zhabdrung Ngawang Namgyal. The Dzong was named Druk Pungthang Dechen Phodrang (Palace of Great Happiness). Visit the Chhimi Lhakhang.','Punakha '),(141,40,'Day-10 Excursion to Gangtey (Phobjikha)','After breakfast, start for full day excursion trip to Gangtey (9,840 ft.). Gangtey is the home of Black Necked Crane which migrates from the arid plains of Tibet in the north. It is a beautiful valley of Bhutan. You can also visit Gangtey Gompha.','Punakha'),(142,40,'Day-11 Punakha Sightseeing','Alternatively, instead of going to Gangtey (Phobjikha), you also have an option spending the day in Punakha Valley itself. After breakfast hike Khamsum Yuelley Namgyal Chorten easy hike to the top of the hill. It offers a breathtaking view of the Punakha Valley. Also visit Punakha Suspension Bridge and Sangchhen Dorji Lhuendrup Nunnery. ','Punakha'),(143,40,'Day-12 Free for leisur','Full day free for leiser','Punakha'),(144,40,'Day-13 Paro Sightseeing','After breakfast hike to the famous Taktsang Monastery - called Tigers Nest. Later visit Drukgyel Dzong & Kyichu Monastery.','Paro'),(145,40,'Day-14 Paro Airport','After breakfast check out from hotel and drop at Paro Airport for your onward journey.','Departure'),(146,40,'Day-15 Phuentsholing - Bagdogara Airport','After early breakfast, proceed to Bagdogara Airport. On arrival board your Flight to your hometown.','Departure'),(147,39,'Day-1 On arrival in Dubai Airport','On arrival in Dubai check-in to your hotel. Later Proceed to Dubai Marina Cruise it is a sight to behold and cruising through the canal beside it promises unparalleled views of the buildings that have become landmarks on the international map. Among the many sights you will pass by, some that you should not miss are the Burj Al Arab, Hotel Atlantis the Palm, Palm Jumeirah, Dubai Marina Yatch Club Promenade, and the Dubai Marina Mall. You will also get a chance to admire the unique architecture that surrounds the area in form of residential buildings, recreational spaces, and office buildings in evening or in night-time cruise you can see New Dubai glittering under the dark sky. Enjoy Marina Dhow Cruise with delicious dinner.','Dubai'),(148,39,'Day-2 Half Day Dubai City Tour & Desert Safari with BBQ Dinner','Today after breakfast you will get an opportunity to get acquainted with Dubai city Tour Visit to Dubais famous landmarks such as the sail-shaped Burj Al-Arab hotel and beautiful Jumeirah Mosque, and learn interesting details about each attraction from a local guide. Take in views of the citys most picturesque palaces and residential areas, and venture into Bastakiya, Dubais inspiring old quarter. Cross Dubai Creek by abra (water taxi) and visit the Spice Soul. vening Enjoy Desert Safari with BBQ Dinner & Belly Dancing.','Dubai'),(149,39,'Day-3 Dubai Frame & Dhow Cruise Dinner','Visit Dubai Frame - known as the biggest picture frame on the planet. Later in the evening we will embark on the Dhow Dinner Cruise- enjoy amazing view of the Dubai skyline.','Dubai'),(150,39,'Day-4 Miracle Garden, Desert Safari with Belly dance show','Today we visit Miracle Garden (if operational) -This is the largest natural flower garden in the world. After that we enjoy thrilling Desert Safari by four wheeled drive Land Cruiser through Sand dunes followed by amazing Belly Dance show along with Dinner.','Dubai'),(151,39,'Day-5 Dubai Aquarium-Underwater Zoo-Burj Khalifa','Today morning after breakfast proceed for Dubai mall and be part of the mesmerizing Dubai Aquarium & Underwater Zoo, it offers fascinating insight into the worlds most mysterious marine life. Later in the evening proceed to visit the Burj Khalifa Described as both a \'Vertical City\' and \'A Living Wonder\', Burj Khalifa, developed by Dubai-based Emaar Properties PJSC, is the world\'s tallest building. Later enjoy the musical fountain show.','Dubai'),(152,39,'Day-6 Abu Dhabi City tour-Ferrari World','Today after breakfast proceed for Abu Dhabi city tour with Ferrari world , the leading seasonal cultural extravaganza in the region and one of the best things to do in Dubai each time you visit.','Dubai'),(153,39,'Day-7 Snow Park','After breakfast, proceed for Snow Park.It is a part of the Mall of the Emirates, one of the largest shopping malls in the world, located in Dubai.','Dubai'),(154,39,'Day-8 Dubai Park Access','In the morning after breakfast get transferred to dubai park access. Lapita is the first park of its kind in the world. In five fascinating zones, you can experience (Any 2 Park Access) different environments inspired by the greatest Bollywood blockbusters.','Dubai'),(155,39,'Day-9 Dubai-Leisure','Today morning after breakfast spend the day as leisure to explore the city on your own and for shopping.','Dubai'),(156,39,'Day-10 Dubai-Departure','After Breakfast at hotel Check out from hotel and get transferred to the airport to catch your flight back to your destination.Tour End','Tour Ends'),(157,37,'Day-1 Depart to Bangkok','Depart Bangkok by Air & overnight stay','Bangkok'),(158,37,'Day-2 Travel Bangkok-Pattaya','Bangkok arrival and after immigration and customs, transfer to Pattaya. Enroute Shri Racha Tiger Zoo, B/F stop. Arrival checkin in to the Hotel. Evening visit colorful Alcazar Show OR Colosium show.','Pattaya'),(159,37,'Day-3 Pattaya-Koh-lan Coral Island','Today we enjoy a high speed boat ride to Coral Island. On arrival, we will enjoy the beauty of the Island by taking a thrilling Para sailing ride, banana boats, scuba diving, scornelling and after lunch back to Pattaya and in the evening visit tropical gardens of noong nooch village, Cultural & Elephant show.','Pattaya'),(160,37,'Day-4 Pattaya Sightseeing','Pattaya local sightseeing','Pattaya'),(161,37,'Day-5 Bangkok local sightseeing','The day is free for optional. Evening Chao- phrya river cruise with musicals & dinner.','Bangkok'),(162,37,'Day-6 Departure from Bangkok','Morning free for last minute shopping & in the evening depart  Timely transfer to the airport for flight to your onward destination.','Tour Ends'),(163,45,'Day-1 Arrive at Mauritius','Arrive at Mauritius International Airport and after receiving your arrival Visa from the Immigration Counter. Our Representative will transfer you to the Hotel. The day is free for leisure. Mauritius is an Ideal Holiday Destination to experience unique sights, sounds & water sports.','Mauritius'),(164,45,'Day-2 Mauritius South Tour','After breakfast drive to Floreal Shopping Factories / ADAMAS Diamand factory / Trou aux Cerfs dead volcano crater. Return back to hotel for overnight stay.','Mauritius'),(165,45,'Day-3 Mauritius East Tour','After breakfast Proceed to the island by coach/Car from your hotel and transfer by speed boat to the island.','Mauritius'),(166,45,'Day-4 Mauritius North Tour','After breakfast proceed for Port Louis The Capital of Mauritius/Marie Reine De La Paix/Citadel Fort/SPEND 2 HOURS IN Caudan Waterfront Cap Malheureux /Riche Terre Mall, Overnight stay at hotel in Mauritius.','Mauritius'),(167,45,'Day-5 Departure','After breakfast, proceed to airport to catch your flight. You will be transferred by Coach. Leave Mauritius with lifetime experience & unforgettable memories.','Tour Ends'),(168,35,'Day-1 Arrival in Sri Lanka-Kandy','Upon arrival at the Colombo Bandaranayke International Airport. You will then be escorted to your vehicle to begin your holiday in Sri Lanka. ','Colombo'),(169,35,'Day-2 Drive Colombo to Sigria','Arrive Colombo & transfer to Sigiriya & evening visit to Lion Rock','Sigiriya'),(170,35,'Day-3 Drive to Kandy','Meet our tour representative who will escort you to the cab to drive to Kandy. While on your tour you will visit one of the world heritages as well as a sacred place for the Buddhists all over the world; namely the Temple of tooth Relic known to the Sri Lankans as Dalada Maligawa.','Kandy'),(171,35,'Day-4 Travel Kandy to Pinnawala','Enjoy a delicious breakfast at your hotel. Today visit Elephant Orphanage in Pinnawala, you can visit one of the most important tourist attractions in Sri Lanka, the Pinnawala Elephant Orphanage. Your next visit will be to the Peradeniya Botanical Gardens which is a paradise for nature lovers.','Kandy'),(172,35,'Day-5 Travel Kandy to Nuwara Eliya','Enjoy a delicious breakfast at your hotel. Today you will visit NuwaraEliya. NuwaraEliya is a city in the hill country of the Central Province, Sri Lanka. En-route visits the famous Ramboda waterfall, Sri Lankan tea plantation and a working tea factory, in NuwaraEliya you will visit the main attractions of the town which include the golf course, trout streams, Victoria Park, and boating or fishing on Lake Gregory.  You can also add Seethe Eliya and Haggala Gardens. See the Eliya is a temple which was mentioned in the famous epic Ramayana. Haggala is a temperate hill-country garden where languid low-country lotus and water lily float in their serene.','Nuwara eliya'),(173,35,'Day-6 Travel Nuwara Eliya to Bentota','Enjoy a delicious breakfast at your hotel. Today you will visit Bentota. Bentota is the city of the Golden Beaches. You will be able to relax and feel the spirit of the sea and the warmth of the soft sand. Bentota provides the perfect turf for unfurled vacation at the beach. While enjoying the sun, sea and sand the water sports lovers can enroll themselves in various water sports bringing in the unique pleasure of this locale.','Bentota'),(174,35,'Day-7 Bentota City sightseeing','Enjoy a delicious breakfast at your hotel. Today you will visit Bentota. City tour Bentota: On your city tour you will enjoy a boat ride along the Maadu River. It is a scenic tour relaxing and interesting while passing many islets forested with mangroves and experience the natural rhythms as well. If you are looking for more exclusive experience visit the turtle hatchery too. The Turtle Hatchery is the prime turtle nesting site which was open by the Wild life Protection Society in 1981. Visitors can see huge tanks filled with new born turtle hatchlings.','Bentota'),(175,35,'Day-8 Travel Bentota-Colombo','Enjoy a delicious breakfast at your hotel. Today you will visit Colombo. Colombo is the largest city and commercial capital of Sri Lanka. Located on the west coast, it is a busy and vibrant city with a mixture of modern and colonial impressions. Colombo has wildly varying architecture that span centuries and depict various styles. Many colonial buildings influenced by the Portuguese, Dutch and British exist alongside structures built in Buddhist, Hindu, Islamic, Indian and Contemporary architectural styles. Colombo also boasts many shopping malls and department stores that offer brand name clothing at highly discounted prices. City Tour: you can visit famous places including Galle Face Green, the Viharamahadevi Park, National Museum, Twin World Trade Center towers, Old Parliament Building, Fort district, Independence Hall at Independence Square, and prominent Buddhist, Hindu, Islam and Christian places of worship.','Colombo'),(176,35,'Day-9 Departure Colombo To Airport','After breakfast, rest at hotel until it is time to depart to airport to catch the return flight.','Tour Ends'),(177,77,'Day-1 Baku Arrival','Welcome to Azerbaijan! Meeting our representative at the Baku at Airport and transfer to the hotel. Leisure time after transferring to our hotel and settling into the hotel.','Baku'),(178,77,'Day-2 Explorer Baku on Arrival','You participate in the panoramic tour of Baku city to explore Baku, to be held in the evening and visit luxurious shopping centers. Then you are transferred to the hotel. ','Baku'),(179,77,'Day-3 Full day Baku City tour','After breakfast at the hotel, visit Highland Park that offers a 360 degree panoramic view of the Baku city, which resembles a massive amphitheater that gently slopes down to the adjoining Caspian Sea! After we depart for Baku Old City Tour. The excursion tour begins with a visit to the Old Town - Icheri Sheher. Visit several caravan-palaces, mosques, baths, etc. Visit to Maiden Tower - \'Baku\'s symbol\'. You can spend a pleasant time in the restaurants that you can taste dishes from national Azerbaijan cuisine. After lunch we will be passing by Baku Boulevard, one of the favorite retreat centers for tourists and inhabitants. Visit historical milestones namely; Baku Promenade, National Carpets Museum, House of the Government, Governor\'s Garden, Magomayev Philharmonic Theatre, Cultural Center Complex, Heydar Aliyev Center, museum and auditorium.','Baku'),(180,77,'Day-4 Drive Baku to Shahdag','After breakfast. We shall depart for Shahdag Skiing tour. Shahdag, is the most popular and elegant Ski resort in Azerbaijan and yet it offers many and for absolute beginners as well as experienced adults. If you wish to Experience skiing Shahdag. You can easily rent skiing equipment when you are there. It is definitely the right address for fantastic ski tour.','Baku'),(181,77,'Day-5 Drive Shahdag to Baku','Today after breakfast checkout from Hotel in Shahdag and proceed to baku.','Baku'),(182,77,'Day-6 Drive Baku to Quba','Breakfast in Hotel Transfer to Quba city for tour There is about 70 natural monuments in the region. Of these, Gelinqayasi, Qizilqaya, Guljahan dashy, Khatadara, Jafar valley, Nana-Huy valley, Khan spring\', \'Stone brides, Tree House, Ateshgah Khaltan water, Khasi hot water, Sona spring, Qirkhbulag, Khan plane, Road guard, Pyrite depression, Oak Forest, Forests, Gyzylagaj forests are natural miracles. There are sulphur water springs located on the banks of Khachinchay in Guba region. The hot water from a narrow ravine has a curative importance. The white-haired eagles living in this ravine were included in the Red Book of Azerbaijan. Guba-Baku transfer Arrival to Baku hotel for refreshment.','Baku'),(183,77,'Day-7 Drive Baku to Gabala','Breakfast in Hotel Departure to Gabala Shamaxi tour on the way: visiting Shamakhi Mosque Arrival to Gabala city, transfer to Gabala Tufandag Summer-Winter Complex Resort cable car Transfer for Check-in to Gabala hotel and Transfer to Gabaland, entertainment center Returm to the hotel for refreshment.','Gabala'),(184,77,'Day-8 Drive Gabala to Baku','Breakfast in Hotel Arrive in Baku and can go for shopping.','Baku'),(185,77,'Day-9 Absheron Peninsula and Shopping','Refresh yourselves with breakfast and be ready and your Baku holidays begin. You will start your journey to Ateshgah for Temple visit. The guest room cells of the chapel are now reconstructed as a Museum for the tourists. After Absheron Peninsula Tour, you will start off for Mehemmedli village visit. From the village you will proceed to Yanardag Fire Mountain which lies next to the village. Glowing continuously for several thousand years by means of natural gas, this mountain is one of its kind and a true nature\'s wonder. After Absheron Peninsula tour. In the evening hours our guide will organize Evening Boat Ride at Caspian See and Ferris Wheel Ride.','Baku'),(186,77,'Day-10 Departure Baku','After breakfast, check out from the hotel. We are transferred to the airport. We see our guests off at the airport and the end of Tour! We hope you have a memorable time in Azerbaijan / Baku and we look forward to seeing you in the future. Have a safe trip back home and thank you for choosing us.','Tour Ends'),(187,23,'Day-1 Welcome to Bali','Arrive into Bali, you will be greeted by our representative at the airport. Proceed to the hotel and check-in.','Bali'),(188,23,'Day-2 water sports Tour & Uluwatu sunset tour','Breakfast will be at the hotel. An ideal Bali holiday is incomplete without Bali water sports. You can enjoy your water sports package with parasailing/flying fish, banana boat & Jet Ski etc. A great southern Bali trip in the evening introduces you to the heart of southern part of the island. The beautiful Uluwatu temple, built on the top of a cliff about 825 feet high facing the vast deep blue Indian Ocean. See the traditional kecak dance and then enjoy a romantic dinner.','Bali'),(189,23,'Day-3 Visit Gili Island','After breakfast take a speed boat to Gili Island. Check in to your hotel & enjoy rest of the day at leisure.','Gili Island'),(190,23,'Day-4 Day at leisure','Enjoy your day at leisure.','Gili Island'),(191,23,'Day-5 Sunset Cruise','Return by speed boat to Bali. In the evening proceed for romantic sunset dinner cruise.','Bali'),(192,23,'Day-6 Balinese Massage','Enjoy an authentic Balinese massage. Rest of the day at leisure.','Bali'),(193,23,'Day-7 Departure from Bali','Enjoy breakfast at the hotel. Check out from the hotel and proceed for the airport to board your return flight back home with eternal memories of your Bali holiday!','Tour Ends'),(194,34,'Day-1 Welcome to Singapore','Today Arrive at Singapore Airport. We shall then proceed to the Hotel and check-in first. Freshen up and relax in the comfort of your hotel room.','Singapore'),(195,34,'Day-2 Night Safari','Today after break the day is free, Later in the Evening proceed to Night Safari. Travel in an open tram through varied terrain that\'s home to more than 1,000 animals, ranging from fierce predators to timid forest dwellers. Under subtle moon glow lighting, which enables you to see the animals but doesn\'t distract them, you can watch Cape buffalo, African bongo, blue sheep, striped hyena, golden jackal, the rare great one-horned rhinoceros and other creatures playing, prowling or feeding in the Night Safari lush grounds.','Singapore'),(196,34,'Day-3 Half Day City Tou, Flyer, Sentosa Tour','After breakfast Proceed to City Tour, an Exciting experience of the metropolis Singapore, proceed for city tour, an exciting experience of the metropolis of Singapore. See Swissotel The Stamford- one of the tallest hotels in the world, City Hall and Parliament House. Visit Mount Faber for a splendid view of the harbour and the city of Singapore. From the waterfront, enjoy the sight of Merlion- Singapores famous symbol and the citys business district. Visit Chinatown- an opportunity to buy souvenirs at bargain prices for your near and dear ones also, Proceed to Singapore Flyer. Later in Afternoon enjoy tour of the unique Sentosa Island.','Singapore'),(197,34,'Day-4 Visit Universal Studios','After Breakfast at the hotel, enjoy a full day excursion to Universal Studios. Enter the thrilling world of movie magic as you \'ride the movies\' on roller coasters and other movie-themed attractions. Be dazzled and delighted by an immersive entertainment experience that brings the silver screen to life.','Singapore'),(198,34,'Day-5 Visit Gardens by the Bay','After Breakfast day is kept free, later in Evening proceed to visit Gardens by the Bay. Gardens by the Bay is a nature park spanning 101 hectares of reclaimed land in central Singapore, adjacent to the Marina Reservoir. The park consists of three waterfront gardens: Bay South Garden, Bay East Garden and Bay Central Garden.','Singapore'),(199,34,'Day-6 Departure from Singapore','Breakfast in the hotel. Later Check Out from the hotel and get transferred to the Airport to catch your flight for departure','Tour Ends'),(200,38,'Day-1 Arrival in Istanbul','Arrive at Istanbul and you will be transferred to the hotel. Rest of the day is free.','Istanbul'),(201,38,'Day-2 Istanbul city tour','We depart from the hotel for the Istanbul City Tour. We will be visiting \'TOPKAPI PALACE\' The great palace of the Ottoman sultans from the 15th to the 19th centuries.  Robes worn by the sultans and their families, the famous jewels of the Imperial Treasury, miniatures, and the Holy Mantle; enshrining relics of the Prophet Mohammed. After a short we head to the Grand Spice Bazaar for shopping. After the shopping tour come back to Hotel.','Istanbul'),(202,38,'Day-3 Istanbul Bosphorus Cruise tour Flight to Izmir','After breakfast depart for Bosphorus Cruise tour. Enjoy the array of sites you can see from the boat including: Grand Bazaar. BOSPHORUS BY BOAT a traditional excursion by boat along the waterway separating Europe and Asia. After the lunch depart for Istanbul Ataturk airport for domestic flight to Izmir. On arrival proceed to the hotel and check in to your hotel in.','Kusadasi'),(203,38,'Day-4 Kusadasi-Ephesus Tour-Turkish Village Sirince','Depart from hotel for fully guided tour of Ephesus, one of the best preserved ancient sites in the world en-route, visiting the Temple of Artemis, Curetes street, famous Roman baths, Celsus Library and Grand theatre. After we will visit a place which continues to perform one of the oldest arts of Turkey a carpet weaving centre. Later we will do a Turkish Village Tour. Sirinces construction style today belongs to Anatolian Greeks. Sirince Village also has a fantastic reputation for making some of the best wines in Turkey - especially fruit wines.','Kusadasi'),(204,38,'Day-5 Kusadasi To Pamukkale Tour','After breakfast, depart for Pamukkale Tour. On arrival visit the calcium terraces of Pamukkale (cotton castle) and the ruins of Hierapolis, then walk around this natural phenomenon and have the option of lying in the waters of the natural springs.','Kusadasi'),(205,38,'Day-6 Pamukkale to Antalya','After breakfast, depart for Antalya. On arrival check-in to the hotel.','Antalya'),(206,38,'Day-7 Antalya Old City Tour And Waterfalls','After breakfast, drive to Antalya old City ( Kaleici ) Marina, Clock Tower, Hadrians Gate, Broken Minaret, Hidirlik Tower: Kaleici is a small historic part of Antalyas modern city, also known as the Old City of Antalya. Later depart for Duden waterfalls. All the streams of the region aim at finding their way into the Mediterranean and they pour down the slopes of the Taurus, sometimes overland sometimes underground and reaching their destination, result in lovely waterfalls, of which there are more than twenty.','Antalya'),(207,38,'Day-8 Drive Antalya-Konya-Cappadocia','After breakfast early in the morning drive to Konya. On arrival in Konya visit the imposing green - tiled Mausoleum of Mevlana, the mystic founder of the Sufi sect (Whirling Dervishes). After the Konya Mevlana tour drive to Cappadocia. On arrival check-in to the hotel.','Cappadocia'),(208,38,'Day-9 Cappadocia underground City & Goreme Open Air Museum','After breakfast drive to Ozkonak Underground City, one of the best preserved Underground cities in Cappadocia. Than visit to Uchisar Castle, the highest point of Cappadocia. After Uchisar, you visit Goreme Open Air Museum, the Heart of Cappadocia. Goreme Open Air Museum is famous for frescoes dating to 10th century describing the life of Jesus Christ and monks. Next stop is Cavusin, which is an abandoned village with old cave Greek houses. Later, visit a pottery work shop, to see how to make potteries. Then you go Love valley where you can see three - headed fairy chimneys. After Love valley you visit another workshop to see Cappadocian handwoven carpets and kilims. Next stop is Devrent Valley and many other sightseeings and you will be returned back to your hotel.','Cappadocia'),(209,38,'Day-10 Return to Home','After breakfast, check-out and depart for Kayseri Airport for our domestic flight to Istanbul and then back to home.','Tour Ends'),(210,78,'Day-1 Arrive in New York / New Jersey','Your delightful America tour begins today. Proceed to your hotel to check in and relax for a while.','New York'),(211,78,'Day-2 Statue of Liberty, New York City Tour, World Trade Center','After breakfast proceed on a guided city tour of New York. Take a ferry to the Statue of Liberty Island. Admire the symbol of American freedom- The Statue of Liberty. See the Ground Zero, Rockefeller Centre, Wall Street, China Town, UN Headquarters and the observatory at One World Trade Center to view the spectacular New York Skyline. In the evening proceed for a delicious dinner.','New York'),(212,78,'Day-3 Washington-Smithsonian Air & Space Museum','After an American breakfast checkout of the hotel and proceed to Washington D. C. the capital of USA. Proceed on to guided city tour of this beautiful Capital City. See the Capitol Building, drive past the Potomac River, and see the famous memorials, Pentagon and White House. Visit the popular \'Smithsonian Air & Space Museum\' which houses the largest collection of space and aircrafts in the world. See the \'Spaceship One\', drone and even touch a lunar rock.','Washington'),(213,78,'Day-4 Hershey\'s Chocolate World, Niagara Falls','After breakfast proceed to Niagara. En-route we visit Hershey\'s Chocolate World, where we will get a chance to jump into the world of Chocolate. Proceed to Niagara Falls.','Niagara'),(214,78,'Day-5 Maid of the Mist, Cave of the Winds','After breakfast visit the falls for it\'s breathtaking view by a boat- \'Maid of the Mist\'- that will take you through the dense mist inside the spectacular falls. Later proceed on a tour of \'Cave of the Winds\', ride an elevator into the Niagara Gorge a lifetime experience. Then you take a helicopter ride to get a magnificent view of the glorious Niagara Falls (weather permitting/optional).','Niagara'),(215,78,'Day-6 Visit NASA - Kennedy Space Centre','Take a flight to Orlando. Visit NASA - Kennedy Space Centre Launch Headquarters, unique chance to visit NASAs launch and landing facilities. Experience interactive simulators, live shows and jaw-dropping encounters with massive rockets, as well as have the opportunity to meet a real member of NASAs Astronaut Corps.','Orlando'),(216,78,'Day-7 Orlando Epcot Centre','Proceed on a full day visit to the Epcot Centre. One of the Theme Parks at the Walt Disney Park, it is the ultimate park combining futuristic technology and entertainment. Feel the excitement, thrill and rush of traveling to a stimulated Space Adventure at its best. Then experience the extraordinary illumination show (time permitting).','Orlando'),(217,78,'Day-8 Sea World','After breakfast, proceed to Sea World. See the Californian Sea Lions and Harbor seals; encounter Shamu - the killer whale. You can see many famous shows and have a gala time.','Orlando'),(218,78,'Day-9 Francisco City Tour','Today, take a flight to San Francisco. Proceed to board the famous Bay Cruise sail past the infamous Island of Alcatraz, which was formerly a prison. See the San Francisco skyline and watch a breathtaking view of the famous Golden Gate Bridge. Then proceed on a city tour of San Francisco. Visit the famous Lombard Street, Civic Centre, Nob Hill, Twin Peaks, Park Presidio and Union Square, China Town.','San Francisco'),(219,78,'Day-10 Las Vegas','Today we take a flight to Las Vegas. After arrival proceed to check in to the hotel. Rest of the day is free for shopping or visit some of the best-known Casinos / Hotels in the world.','Las Vegas'),(220,78,'Day-11 Grand Canyon, Hoover Dam, V Show','Today you proceed on an Air Tour excursion to Grand Canyon. It is created by the Colorado River cutting a channel over thousands of years and attaining a depth of more than 1600 meters. After that you will be visiting Hoover Dam, which stands 725 feet above the Colorado River, is a breathtaking sight every tourist must experience and you will be experiencing this exclusively with Mango Holidays!! Stroll around the dam and admire the massive man-made wonder. In the evening specially included is the world famous \'V\' Show. In the end you are bound to say, \'Never seen anything like this before\'.','Las Vegas'),(221,78,'Day-12 Calico Ghost Town- Los Angeles','Today we proceed to Los Angeles. Visit Calico Ghost Town. Embark on a City Tour of Los Angeles. Stroll on the famous Hollywood Boulevard; visit Kodak Theatre, which is the place for the famous Academy Awards, Chinese Grauman\'s. Ride on infamous Sunset Boulevard, Doheny Drive, famous Beverly Hills and the most expensive street Rodeo Drive, the shopping place for the Rich and Famous personalities.','Los Angeles'),(222,78,'Day-13 Universal Studios','After breakfast, visit the famous Hollywood\'s \'Universal Studios\'. You can ride on to the famous Tram, enjoy the Jurassic Park Roller coaster, Revenge of the Mummy and visit the latest Simpson\'s Ride. In the evening enjoy dinner.','Los Angeles'),(223,78,'Day-14 Return home with eternal memories','After breakfast, proceed to the airport to board your flight back home. Then it is time to say goodbye to your new friends and take home memories of your amazing tour','Tour End'),(224,79,'Day-1 Arrive Calgary Airport and transfer to Banff','Arrive Calgary and transfer from Calgary International Airport to Banff. On arrival, check-in at hotel. Rest of the day at leisure.','Banff'),(225,79,'Day-2 Banff Wildlife Tour','After breakfast, proceed on Discover Banff and Wildlife Tour. Visit Banff viewpoints, landmarks and historic places on this popular half day sightseeing tour. Enjoy the stunning scenery and short walks to the must see locations, taking photos and watching for wildlife. Afternoon, take an optional Snowshoeing Tour to Marble Canyon.','Banff'),(226,79,'Day-3 Banff Icewalk Tour & free at leisure','After breakfast, day is free at leisure. Go on an optional Johnston Canyon Icewalk Tour. The Johnston Canyon Icewalk traverses a series of steel catwalks that give spectacular views of the Johnston Canyon below. Afternoon go on an optional Horse drawn Sleigh Ride Tour. The sleigh ride will take you through the Bow River Valley showing you the remote areas around Banff.','Banff'),(227,79,'Day-4 Banff to Lake Louise','After breakfast, check-out of hotel and transfer to Lake Louise. Lake Louise is an icon for Canada and a stunning place to visit. Afternoon go on an optional Dogsledding Tour. Dogsledding is the most popular winter activity and an adventure suitable for anyone. Evening at leisure.','Lake Louise'),(228,79,'Day-5 Lake Louise-Try Ice Skating across a frozen lake','After breakfast, day is free at leisure. Try Ice Skating across a frozen lake, breathing in the icy cold air, surrounded by incredible mountains. Afternoon try exploring Snow Tubing on own. It is similar to tobogganing. Tubing is a great activity for all ages, including children. This exhilarating outing can be enjoyed at the Mt. Norquay.','Lake Louise'),(229,79,'Day-6 Lake Louise to Calgary Airport','After breakfast, check-out of hotel and transfer to Calgary Airport to connect flight to onward destination.','Tour Ends'),(230,22,'Day-1 Arrival at Hong Kong','Arrive at Hong Kong airport. On arrival, check-in at hotel.','Hong Kong'),(231,22,'Day-2 Hong Kong City Tour','Proceed to Hong Kong \'City Tour\', Aberdeen Village, Jewellery Factory, and Madame Tussaud\'s Wax Museum, Victoria peak.','Hong Kong'),(232,22,'Day-3 Hong Kong-Ocean World','After breakfast Half day visit to Amusement park of Ocean World, Rare glimpse of Black Panda. Evening free at your Leisure.','Hong Kong'),(233,22,'Day-4 Disneyland Tour','After breakfast visit to Disneyland, located on scenic Lantau Island. Magical experiences ranging from Broadway-style shows hilarious 3D movies & thrilling music adventure to signature Disney. Spectacular fireworks and parades.','Hong Kong'),(234,22,'Day-5 Hong Kong-Macau','You can Experience the 60 minutes Ferry Ride to Macau. On arrival check in into the hotel and relax. Evening free for shopping / Casinos','Hong Kong'),(235,22,'Day-6 Macau-City Tour','Visit ruins of St. Paul Catheral / Chruch, Speed jet Ride, Senado Square, Kum Iam Status and Lotus Square. Experience heights of Macau Tower at the 223 meters & enjoy panoramic view of Macau City & ferry to Hong Kong Airport to take a return flight.','Tour Ends'),(236,46,'Day-1 Arrival at Cairo International Airport','Arrival at Cairo International Airport, greeted by our representative who will assist the group through immigration and customs formalities. Transfer to the hotel and check in.','Cairo'),(237,46,'Day-2 Cairo visit pyramids of Giza and Sphinx','Proceed with a full day tour to visit (The great pyramids of Giza and Sphinx, The Egyptian museum & Khan El Khalili Old Bazaars).Transfer back to the hotel.','Cairo'),(238,46,'Day-3 Cairo Nile Cruise (Monday/Wednesday/Friday)','Transfer to Cairo airport for the flight to Aswan. Upon arrival, Proceed with the visits of Aswan including (The high dam, The unfinished obelisk & The temple of Philae). Embarkation. Afternoon tour by Felucca around (Elephantine island, Botanical garden & Agha Khan). Dinner and Overnight on board cruise ship in Aswan.','Aswan'),(239,46,'Day-4 Nile Cruise','Breakfast on board. Lunch will be served on board while sailing to Kom Ombo. Visit the temple of Kom-Ombo, dedicated for gods Sobek and Haroeris. Afternoon sail to Edfu Dinner and overnight on board cruise ship in Edfu.','Edfu'),(240,46,'Day-5 Nile Cruise','Breakfast on board. Visit the temple of Edfu, dedicated to the god Horus. Lunch on board during sailing to Esna. cross Esna lock and sail to Luxor. Overnight on board of the cruise ship in Luxor.','Luxor'),(241,46,'Day-6 Hurghada','Breakfast and Disembarkation from the cruise. Proceed to visit the west bank including (The two colossi of Memnon, The temple of Queen Hatshepsut &The valley of the kings). Proceed to visit the east bank including (Karnak temple & Luxor temple). Transfer to Hurghada by a private A/C modern coach. Upon arrival, Transfer to the hotel and check in.','Hurghada'),(242,46,'Day-7 Hurghada','Breakfast at the hotel. Free Day at Leisure. Lunch & Dinner will be served at the hotel.','Hurghada'),(243,46,'Day-8 Departure from Hurghada','Buffet breakfast at the hotel and check out. Transfer to Hurghada airport for the final departure flight via Cairo.','Tour Ends'),(244,57,'Day-1 Arrive Keflavik, Aurora Museum, Reykjavik','Arrive Keflavik International airport. After Customs & Immigrations. Later drive towards Reykjavik & and Check in at Hotel. Evening visit Aurora Museum. The Museum possesses detailed information on Northern lights, science behind it, where all can it be seen, followed by a video of Northern lights shot in Iceland.','Reykjavik'),(245,57,'Day-2 Golden Circle Tour','Today we proceed towards Golden Circle; Our first destination will be Pingvellir National Park. The park is a place of great beauty located on the biggest lake of Iceland (Thingvellir Lake) where the Tectonic Plates of North America and Euro Asia continent drifts apart each year. The park is a UNESCO World Heritage Site. Later continue the journey towards Geysir - home to the Littli Geysir & the great Strokkur Geyser which erupts about every 8 minutes. It truly is a sight to behold. Followed by Geysir is the Gullfoss Waterfall, one of the most impressive waterfalls in Europe that falls in two folds.\n','Reykjavik'),(246,57,'Day-3 Drive Reykjavik-Akureyri','Today we proceed towards the Capital of North of Iceland- Akureyri, for a Long drive that passes through various landscapes and is one of the most scenic drives. En-route photo stop at Turf farmhouses at Glaumbaer Museum (from outside) Evening enjoy a stroll and walking orientation tour of Akureyri town covering the Church, Fjord waterfront, Akureyri Botanical garden and old town pedestrian street. Later check in at hotel.\n','Akureyri'),(247,57,'Day-4 Diamond Circle tour','Today we enjoy North Icelands most famous Diamond Circle tour. We stop first on route at Godafoss waterfall, the waterfall of the pagan gods. Then we continue to the Lake Myvatn area where we spend the day exploring the wonders around the lake, which is one of Icelands most interesting regions with pseudo craters, dimmuborgir lava fields, Namaskard geothermal boiling mudpool area, etc. Later visit the beautiful Myvatn nature baths for a relaxing geothermal bath in a stunning natural lagoon. Evening proceed back to Akureyri.\n','Akureyri'),(248,57,'Day-5 Akureyri into the glacier Borgarnes','Today morning - we begin our journey towards Langjokull (second largest glacier in Iceland). Our first stop will be at Deildartunguhver, hot spring in Reykholtsdalur, Iceland Later on, we visit most picturesque waterfall \'Hraunfossar & Barnafos\'. Here we have a 10 min walking trail. Later we continue to get Up close and personal on a glacier - the best way to experience Iceland! The walking tour inside the Glacier is of an hour plus the to and fro journey in Super Jeep is of 45 mins each way. This is truly a once in a lifetime experience which you might not encounter anywhere else in your life.\n','Borgarnes'),(249,57,'Day-6 Borgarnes-Snaefellsnes-peninsula-Lava Cave','This tour takes you to west from Reykjavik on a scenic route to Borgarfjorour and the village of Borgarnes. Shortly after entering Snaefellsnes peninsula, by Ytri-Tunga Farm you all get a chance to spot local wildlife at the beach which is home to a seal colony and variety of sea birds. Next is a visit to the idyllic Arnarstapi village where you will take a walk to view the extraordinary landscape along the precipitous shoreline. We start our next adventure by visiting Vatnshellir Cave. Later we visit Grundarfjörður is home to one of the peninsulas\'s most iconic and photographed landmarks, the symmetrical mountain Kirkjufell that towers 1500 ft. up from the shoreline.\n','Borgarnes'),(250,57,'Day-7 Borgarnes-Seljalandsfoss-Skogafoss-Black Sand Beach','Today morning - we checkout and proceed towards Vik. We begin our journey towards South Iceland. Our first stop will be at most picturesque waterfall \'Seljalandsfoss & Skogafoss\' followed by Black Sand Beach. We visit the very first location of Gerua fame waterfall- Seljalandsfoss, then we continue journey towards Skogafoss. During the journey we enjoy charming views and scenery. 2nd waterfall Skogafoss on a bright sunny day at least 2 rainbows are visible at a time. Later we visit BLACK SAND BEACH (one of its only kind in the world). Later Check in at Hotel.','Vik'),(251,57,'Day-8 VIK Skaftafell National Park-Jokulsarlon Glacier Lagoon-Diamond Beach-VIK','Today we continue east and drive past Eldhrun lava fields, followed by Skaftafell National park beneath Vatnajokull Glacier. Our journey continues till we reach the glacier lagoon Jokulsarlon, one of the most spectacular sights in Iceland. Here we will take photo-stop and walk around the lagoon to enjoy this amazing landscape. Opposite to the lagoon is the Diamond Beach where you have the icebergs that are at the shore making it beautiful location to photograph at. Evening back to hotel.\n','Vik'),(252,57,'Day-9 VIK Flyover Iceland Raykjavik Orientation Tour','Today we check out & will be proceeding towards Flyover Iceland in Reykjavik. Later we proceed towards Reykjavik orientation tour where we cover all sightseeing points such as Sun Voyager, Harpa concert house, City Hall, Parliament House, etc. Later afternoon we proceed towards the famous Blue Lagoon. The Blue Lagoon is a unique sight where guests enjoy relaxing in warm geothermal water surrounded by magical black lava fields. The Blue Lagoon\'s warm water and natural active ingredients; mineral salts, silica and blue green algae, help you relax and escape the stress and strain of daily life Later Check in at Hotel.','Keflavik'),(253,57,'Day-10 Departure','Today we proceed towards Airport to catch return flight back home or onwards destination.\n','Tour Ends'),(254,28,'Day-1 Arrive Maldives','Welcome to the tropical paradise of Maldives! After reaching there, get transferred by a Big boat to your resort and check-in to your room. Spend the day relaxing and admiring the views of crystal clear waters ebbing sandy beaches.','Maldives'),(255,28,'Day-2 Maldives Day Free','After a hearty breakfast today, we have many recommendations for you. You may choose to take a sun bath on the beach, go for a swim or do absolutely nothing! If adventure is what you like, opt for some water sports like snorkelling, wind surfing or have fun on a banana boat ride.','Maldives'),(256,28,'Day-3 Maldives Day Free','After a delicious breakfast today, we recommend you pamper yourself with an indulgent spa treatment. Choose from a relaxing aroma therapy treatment or a rejuvenating body spa wellness After a relaxing day, enjoy a comfortable.','Maldives'),(257,28,'Day-4 Maldives Day Free','After Breakfast the day is kept free. Enjoy the stay in Resort or have a body spa or else Enjoy water sports on Own.','Maldives'),(258,28,'Day-5 Departure Flight','Enjoy a hearty breakfast at the hotel and then check-out. A speed boat will await you for your transfer to the airport. Fly back home with wonderful memories of an amazing trip!','Tour Ends'),(259,74,'Day-1 Arrive at Muscat Airport','On arrival at Muscat Airport, you will be met by our local representative and transferred to your hotel. The rest of the day is free to explore the city on your own.','Muscat'),(260,74,'Day-2 Muscat City Sightseeing','Today you visit the 5 largest mosque in the world, the Sultan Qaboos Grand Mosque. Passing by the diplomatic quarter, you will be taken to the oldest and largest market in the country, Muttrah souq. This is a time for you to shop for your Omani souvenirs. Walk through its narrow alleys where the air is filled with the smell of frankincense and sandalwood. Next stop is the Al Alam Palace where the Sultan receives his state guests. The palace is flanked by two Portuguese fortresses, Al Jalali (1578) to the right and Al Mirani (1581) to the left. At a museum, you will witness traditional artefacts and traces of history and pre-history of Muscat.','Muscat'),(261,74,'Day-3 Visit Nizwa-the cultural capital','Today you will start your fascinating roundtrip by exploring the cultural capital of the country Nizwa. If it is a Friday, you have the opportunity where the herders bring their cattle to be auctioned once a week. Explore the cultural capital of the country where its souq is still the best place to buy silver in the country. This is followed by a visit to the most visited national monument - Nizwa Fort. Entry is optional. Then you visit Omans most beautiful castle from the 17th century, Jabreen, and another UNESCO site, Bahla Fort, the oldest and biggest fort in the country.','Muscat'),(262,74,'Day-4 Visit Jabal Shams','Today morning you procced to Al Hamra. Here, the village women demonstrate old practices such as milling, coloring, cooking and more. A truly enriching experience. To the west of Al Hamra lies the road winding up Jebel Shams, the mountain of the sun. It is the highest mountain of the Arabic world and reaches 3075 m above sea level. Some kilometers further you reach the abyss of the Omani Grand Canyon. Enjoy the breathtaking views. Then visit the mountain village of Misfah which offers rewarding views of ancient architecture seen in stone houses.','Muscat'),(263,74,'Day-5 Visit Wahiba Sands','And then its time for the desert. Enjoy the drive through the stunning dunes. Their forms change with the wave of the wind. After your arrival in the camp you climb up on a lonely dune to watch the miraculous sunset. The day ends under the sky of Oman while you sit together around the fire place and try Omani specialties.','Muscat'),(264,74,'Day-6 Visit Wadi & Turtles','Start your day by visiting the celebrated Wadi Bani Khalid. The ever-green Wadi Bani Khalid is one of the most famous ones of the entire Sharqiyah region. The river never dries out completely throughout the continuous water current. Large palm-lined ponds with turquoise and sapphire colored water invite for a swim. Arriving to the fishing town of Sur, the home of Omani traditional Dhows (boat), you will visit the dhow factory in the open air museum. At night, an extraordinary experience awaits you at the Turtle beach where you will get the opportunity to witness sea turtles coming to the shore and laying eggs!','Muscat'),(265,74,'Day-7 Muscat Coast and Wadis','Today we start the day with passing by Bimmah Sinkhole with its azure saltwater pool. Then there s a possibility of leisure hike through the twin wadis of Shab and Tiwi. You will determine the best suited itinerary for the day. There is a possibility for swimming along the way so prepare some change of clothes!','Muscat'),(266,74,'Day-8 Departure Flight','And here your unforgettable journey ends.','Tour Ends'),(267,80,'Day-1 Arrive in Cape Town','Upon arrival at Cape Town International Airport, transfer to your pre- booked hotel. Cape Town is one of the most popular long-haul destinations in the world. Due to its unique topography, it is also one of the easiest places in which to orientate oneself as long as you remember that with Table Mountain behind you and Robben Island before you; you are facing north, looking across Table Bay and up the west coast of Africa.','Cape Town'),(268,80,'Day-2 Cape Town City Tour, Table Mountain','After breakfast leave on a half-day Mother City tour. You will go for a scenic coastal drive through Clifton and Sea Point and later tour passes the Houses of Parliament, the Castle, the SA Museum, and a few other historical sights- District Six, Bo-Kaap, Slave Lodge and ending at the bustling Greenmarket Square. A cable car ride, takes you up the Table Mountain (weather permitting otherwise Signal Hill) for a breathtaking view over the city Return to your hotel.','Cape Town'),(269,80,'Day-3 Drive Peninsula tour','Breakfast is taken at the hotel. Depart on a full day Peninsula tour This comprehensive tour shows you the best of the spectacular Cape Peninsula and why it is called the Fairest Cape. Travel past Sea Point and Camps Bay, past the famous beaches of Clifton and Llandudno towards Hout Bay. Drive along the Atlantic Seaboard. Later get the photo opportunity to take some pictures at the second southern most tip of the African continent. Visit the beautiful Boulders Beach, and have the option to sit among the famous colony of Jackass Penguins. Return to the hotel.','Cape Town'),(270,80,'Day-4 Visit Oudtshoorn','After breakfast, check and transfer to Oudtshoorn. It is known as the \'Feather Capital of the World\' thanks to its huge ostrich industry. Arrive and in the afternoon, enjoy a tour of the Wildlife Ranch where you will visit a crocodile Park where you have opportunity to take pictures with Cheetah. Check into hotel and spend rest of evening in the comfort of your hotel.','Cape Town'),(271,80,'Day-5 Drive Cango Caves, Knysna','After breakfast leave for a tour of the Cango Caves - In Oudtshoorn you go underground to marvel at the icy formations in the Cango Caves, regarded as one of South Africa\'s most spectacular natural wonders Later enjoy a tour of the Ostrich Farm before your transfer to Knysna. Arrive in Knysna, later you will go on a cruise on the vast Knysna Lagoon. Enjoy an amazing view of the imposing sandstone \'Heads\' which guard the sea entrance to Knysna\'s huge tidal lagoon, and the forests, marshes and pristine beaches surrounding it. Evening, you check into the hotel.','Knysna'),(272,80,'Day-6 Knysna, George, Johannesburg, Sun City','After breakfast transfer to George airport to board a flight to Johannesburg. On arrival you are met by a representative for a transfer to Sun City. The Sun City complex is surrounded by two championship golf courses, numerous swimming pools and a huge man-made lake offering various water sports. Optional activities include Hot Air Ballooning.','Sun City'),(273,80,'Day-7 Sun City Sightseeing','After breakfast you will enjoy your day at leisure.','Sun City'),(274,80,'Day-8 Drive Kruger National Park','After breakfast transfer to Kruger National Park. The Kruger National Park in South Africa is one of the oldest and largest reserves in Africa. The park boasts a tremendous variety of game- The Big 5 and bird life in its numerous habitats. You should see: elephant, giraffe, zebra, buffalo, warthog, lion, spotted hyenas, baboon, hippo, impala, kudu, vervet monkey, waterbuck, Tsessebe, wildebeest, bush baby, mongoose, duiker, steenbok, klipspringer, genet, bats. You may see: leopard, wild dog, cheetah, roan antelope, sable antelope, bat-eared fox, rhino, honey badger, porcupine, rebook, aardvark, aardwolf, civet, and caracal and serval suni. Arrive and check in the lodge.','Kruger'),(275,80,'Day-9 Kruger National Park','Enjoy a full day game drive.','Kruger'),(276,80,'Day-10 Departure','After breakfast, transfer to OR Tambo International for flight back home. Return home with eternal memories of your South Africa tour!','Tour Ends'),(277,75,'Day-1 Arrive in Sydney','Arrive Sydney & SIC Transfer to Hotel.','Sydney'),(278,75,'Day-2 Sydney City Tour, Sydney Showboat','Breakfast at the hotel. Proceed for Half Day Sydney City Tour with Bondi Beach. In the evening proceed for Sydney Showboat Cruise with Indian dinner.','Sydney'),(279,75,'Day-3 Sydney Combi Tickets','Proceed to visit attractions - Sea Life Aquarium / Madame Tussauds / Sky Tower Eye / Wildlife Zoo. (optional)','Sydney'),(280,75,'Day-4 Blue Mountain Tour','Breakfast at the hotel. A coach will pick you up from your hotel for transfer to the departure point of your tour. Star full day Blue Mountains tour from the morning. Travel over the iconic Sydney Harbour Bridge and head west towards the Blue Mountains. Visit the quaint village of Leura to purchase morning tea (own expense), then head to Scenic World and enjoy views of the Jamison Valley. You may choose to ride the Railway, Cableway or Skyway (own expense).','Sydney'),(281,75,'Day-5 Drive Sydney to Cairns','Proceed to Cairns.','Cairns'),(282,75,'Day-6 Great Barrier Reef','After breakfast proceed to see the stunning Great Barrier Reef by Big Cat Green Island Cruise with Lunch.','Cairns'),(283,75,'Day-7 Kuranda Village Tour with Skyrail to Caravonica ','After breakfast proceed to see the Kuranda Village Tour with Skyrail to Caravonica.','Cairns'),(284,75,'Day-8 Cairns Gold Coast','After breakfast proceed to Cairns Gold Coast.',' Gold Coast'),(285,75,'Day-9 Sea World','After breakfast return SIC transfer to Sea World Admission',' Gold Coast'),(286,75,'Day-10 Movie World','After breakfast return SIC transfer to Movie world Admission',' Gold Coast'),(287,75,'Day-11 Departure','After breakfast, proceed to the airport to board your flight back home. Return home with eternal memories of your Australian holiday!','Tour Ends'),(288,76,'Day-1 Arrive in Auckland','On arrival, seat in coach guests will be met and privately transferred to hotel.','Auckland'),(289,76,'Day-2 Auckland sightseeing','Enjoy a morning sightseeing tour of Auckland city. Visit Kelly Tarlton\'s Sealife Aquarium and Antarctic Encounter. The remaining of the day is free.','Auckland'),(290,76,'Day-3 Drive Auckland to Rotorua via Waitomo','Travel south through the fertile Waikato region to arrive at Waitomo. Enjoy a guided tour of the famous Glowworm Caves including underground boat ride. Continue to Rotorua this afternoon.','Rotorua'),(291,76,'Day-4 Rotorua sightseeing','Visit Te Puia Thermal Reserve to see boiling mudpools and roaring geysers. Following this, visit Agrodome for a farm show and Rainbow Springs to see trout, birds and wildlife. The afternoon is at leisure.','Rotorua'),(292,76,'Day-5 Rotorua to Cristchurch','Depart on your domestic flight from Rotorua to Christchurch (airfare optional)','Christchurch'),(293,76,'Day-6 Cristchurch-MT Cook-Queenstown','Travel across the fertile Canterbury Plains to Lake Tekapo and the Church of the Good Shepherd before continuing on to New Zealand\'s highest mountain - Mt Cook. Depart Mt Cook and follow the shores of Lake Pukaki south through the historic Central Otago region to the \'Alpine Resort\' of Queenstown.','Queenstown'),(294,76,'Day-7 Queenstown','Enjoy a Queenstown Highlights city tour today (seat in coach guests), including AJ Hackett Bungy Centre, Arrowtown and Gibbston Valley Winery. The remaining of the day is at leisure.','Queenstown'),(295,76,'Day-8 Milford Sounds','Follow the southern arm of Lake Wakatipu to Lumsden, and onward to Lake Te Anau. Enter the Eglinton Valley and travel through the breath taking man made Homer Tunnel to reach Milford Sound. Enjoy a cruise on this world famous fiord, dominated by Mitre Peak and the cascading Bowen Falls. Return to Queenstown.','Queenstown'),(296,76,'Day-9 Queenstown','A free day to explore the endless optional attractions available. (Not included in the tour price)','Queenstown'),(297,76,'Day-10 Departure','After breakfast SIC customers will be transferred to airport in a shared vehicle.','Tour Ends'),(298,31,'Day-1 Arrival at Phuket Airport','Arrival at Phuket airport. Transfer to hotel. Check in to the hotel. Evening proceed for the fantasia show.','Phuket'),(299,31,'Day-2 Phi-Phi island tour','Phi-Phi island tour : Spectacular Cruise to Phang Nga Bay, explore mangrove forest, sea caves, limestone sea rock formations and James Bond Island','Phuket'),(300,31,'Day-3 Phuket City Tour ','Beautiful architecture and scenic views Dolphin shows Cape Promthep : Picturesque cape and stunning sunset','Phuket'),(301,31,'Day-4 Phuket-Krabi','Check-out from hotel. A romantic ride by speed boat to Krabi island Check in to the hotel. Evening at leisure.','Krabi'),(302,31,'Day-5 Krabi city tour','Emerald Pool & Hot water spring with elephant trekking Evening at leisure','Krabi'),(303,31,'Day-6 Krabi Bangkok','Check out from hotel and airport transfer. Arrive at Bangkok. Afternoon free for shopping.','Tour Ends'),(304,33,'Day-1 Arrival to Riyadh','Arrival to Riyadh & transferred to your hotel. Check in hotel. Night Tour (optional)','Riyadh'),(305,33,'Day-2 Riyadh Historical Tour','After breakfast, Start your tour visiting the National Museum of Saudi Arabia. Then enjoy the National museum park walks through the outdoor gardens one of the best gardens you will visit in Saudi Arabia. Then proceed to the Hall of King Abdulaziz where there is a showroom of old cars that were used by the king. Next visit to Murraba palace is among the most important palace built by King Abdulaziz. Then you will visit the Dira Souq traditional Saudi market which is famous for its variety of old copper and brass objects including silver daggers, silver Beduin\'s Jewelry and dresses. Then visit The Imam Turki bin Abdullah Mosque is an active place of worship in Riyadh.','Riyadh'),(306,33,'Day-3 Edge of The World Tour','After breakfast, Drive to Jebel Fihrayn popularly known as \'the Edge of the World\'. These cliffs rise dramatically from the desert, stretching toward the sky like a great natural wall.','Riyadh'),(307,33,'Day-4 Ushaiqer Heritage Village Tour','After breakfast, Drive to Ushaiqer heritage village will introduce you to the charming nature and ancient architecture of Saudi Arabia. ','Riyadh'),(308,33,'Day-5 Riyadh Free day','After breakfast, free day. (Discover Al-Qara Hill & Jawatha AlAhsaa Tour- Optional)','Riyadh'),(309,33,'Day-6 Fly to Al Ula','After breakfast, transfer to Riyadh airport to take your flight to Al Ula, Start your tour visiting  Jabal lkmah-Rock Art.','Al Ula'),(310,33,'Day-7 Madain Saleh','After breakfast, Start your tour visiting  Dadan- An Ancient Arabian Kingdom.','Al Ula'),(311,33,'Day-8 Hegra-Fly to Jeddah','After breakfast, Experience Hegra-A UNESCO World Heritage Site Journey through time in a breathtaking landscape and discover the archeological highlights of Hegra. Then transfer to Al Ula airport to take your flight to Jeddah.','Jeddah'),(312,33,'Day-9 Jeddah Historical Tour','After breakfast, Start your tour to visit Jeddah\'s historical downtown area (Al-Balad) which is the historical area well known as the \'Old Town\'. Then you will visit Al Tayebat International City Museum. After that, you will enjoy a ride along The New Jeddah Corniche is the 30 km coastal resort area of the city of Jeddah.','Jeddah'),(313,33,'Day-10 Al Wahbah Crater','After breakfast, Drive to A wonderful, and still relatively unknown place in the heart of Saudi Arabia.In western Saudi Arabia is a natural wonder that intel recently was pretty unknown to the outside world.','Taif'),(314,33,'Day-11 Taif City Tour','After breakfast, Pick you up from your hotel in Taif. Start the tour with Shubra Palace. Then will take you to Al Rudaf Park.Its a great place to relax and enjoy the beauty of nature! Then visit old Souq in Taif city. Then go to the oldest and best shopping mall in Taif, Taif\'s Heart Mall. Then visit Al Shafa mountain and Al Hada mountain,It\'s considered as one of the most beautiful and important mountain roads in the region. Nice drive up Al Shafa mountain is the highest mountain in the area of the town.','Jeddah'),(315,33,'Day-12 Jeddah- Fly to Abha','After breakfast, Transfer to Jeddah airport to take your flight to Abha, Arrival and transfer to start your tour visiting the Jabal Sawda is the highest point in Saudi Arabia.','Abha'),(316,33,'Day-13 Trip to Rijal Almaa','After breakfast, We will take you to Rijal Almaa village which is famous for its typical Arabian traditional architecture that can be found throughout the whole country, each region having its own specificity.','Jeddah'),(317,33,'Day-14 Departure','After breakfast, transfer to the airport.','Tour Ends'),(318,71,'Day-1 Welcome to London','The Tour Manager / Station Manager / local representative will meet you outside the arrival hall after you collect your baggage. Proceed for hotel and check in.','London'),(319,71,'Day-2 Guided City Tour of London-Visit Tower of London-Ride on London Eye','Today, proceed for a guided city tour of London: See the Buckingham Palace, Hyde Park, Big Ben, Westminster Abbey, Houses of Parliament, Trafalgar Square, Tower Bridge and Thames River. Next visit the Tower of London-housing Britain\'s Crown Jewels including the Kohinoor Diamond. Later enjoy a ride on the London Eye.','London'),(320,71,'Day-3 Windsor Castle-Madame Tussauds Wax Museum-Lords Cricket Ground','This morning, proceed for a visit of the famous Windsor Castle - Queen of England-s favorite weekend home. Next visit the famous Madame Tussauds Wax Museum. Later proceed for guided tour of Lords Cricket Ground.','London'),(321,71,'Day-4 Oxford University-Cadbury World-Manchester','Today, check-out and proceed to Manchester for guided tour of Oxford with visit to a University. Continue the drive to Birmingham to visit Cadbury World. Later proceed to Manchester.','Manchester'),(322,71,'Day-5 Old Trafford Stadium-Steam Train Ride-Lake Windermere Cruise ','This morning, check-out and proceed to visit the famous Old Trafford Stadium - home to Manchester United Club. Visit the home changing room, sit in the dugout & run down the tunnel to the roar of the crowd. Later go for a Steam Train ride in Lake district and also a cruise on the Lake Windermere.','Carlisle'),(323,71,'Day-6 Gretna Green-Gretna Gateway Outlet Village','Today, check-out and proceed to Gretna Green - one of the World\'s most popular runaway Wedding Destinations. Next visit Gretna Gateway Outlet Village and spend some free time for shopping.','Glasgow'),(324,71,'Day-7 Guided City Tour of Edinburgh-Visit Edinburgh Castle','This morning, proceed for a guided City Tour of Edinburgh: Visit Edinburgh castle, see the Scottish Parliament and many more interesting sights. Next proceed for a Scottish whiskey experience tour. Next spend some free time for shopping at the Royal Mile.','Glasgow'),(325,71,'Day-8 Fly back home with pleasant memories','Proceed to the airport for your flight back home. Do spare a few minutes to share your feedback with your Tour Manager. Your valued suggestions will be most appreciated. Arrive home with pleasant memories of your European tour, which we are sure you will treasure for a lifetime.','Tour End');
