'<div>1. A valid passport with at least 6 months of validity left</div><div>2. Passport pictures from the last three months</div><div>3. Pay the application costs for the visa</div><div>4. A valid passport that will remain valid for at least 6 months after the day you leave St. Kitts and Nevis</div><div>5. Proof that you have sufficient funds to cover all of the costs associated with your trip</div><div>6. A departure voucher or ticket showing when and how you will leave St. Kitts and Nevis</div>'),(183,'Saint Lucia','Tourist Visa',0.00,0.00,'30 Days','','','<div>1. Original Passport with at least 6 months validity and minimum 3 blank pages + all old passports if any</div><div>2. 2 Scanned recent colour photograph. (Photo Specification);</div><div>3. Visa Application forms: completed and signed</div><div>4. Personal Covering letter: explaining purpose of travel to the country</div><div>5. Original Bank Statement: stamped &amp; updated for last 3 months with bank seal</div><div>6. Air tickets: proof of return flight tickets from and back to your home country</div><div>7. Hotel reservation: proof of accommodation for your entire stay</div><div>8. Travel Itinerary: day-wise plan outlining all elements of the trip</div>'),(184,'Saint Pierre And Miquelon','Tourist Visa',0.00,0.00,'30 Days','','','<div>1. Passport must be valid for a minimum of 6 months</div><div>2. Valid ID card(if required)</div><div>3. Original birth certificate (if required)</div>'),(185,'Saint Vincent And The Grenadines','Tourist Visa',0.00,0.00,'30 Days','','','<div>1. General documents</div><div>2. Birth,Death,Burial certificates</div><div>3. Marriage, Divorce certificates</div><div>4. Adoption certificates</div><div>5. Identity card</div><div>6. Police, court,prison records</div><div>7. Military records</div><div>8. Passports &amp; other travel documents</div><div>9. Other records</div><div>10. Visa issuing posts</div><div>11. Visa services</div><div><br></div>'),(186,'Samoa','Tourist Visa',0.00,0.00,'30 Days','','','<div>1. Original Passport with at least 6 months validity and minimum 3 blank pages + all old passports if any</div><div>2. 2 Scanned recent colour photograph. (Photo Specification);</div><div>3. Confirmed return flight ticket</div><div>4. Accommodation proof (hotel booking or invitation letter if visiting relative/friend)</div><div>5. Sufficient financial funds (while in Samoa)</div><div>6. Supporting documents relating to Business trip</div>'),(187,'San Marino','Tourist Visa',0.00,0.00,'30 Days','','','<div>1. Hold a passport valid for at least six months beyond your date of country exit and with one blank visa page</div><div>2. Hold proof of onward and return flights</div><div>3. Hold all documents required for the next destination</div><div>4. Hold documents showing proof of travel purpose (e.g. business cover or support letter, conference registrations, etc.)</div><div>5. Hold proof of sufficient funds relative to your intended length of stay</div><div>6. It is recommended that you confirm with your airline that boarding will be permitted without a visa</div>'),(188,'Sao Tome And Principe','Tourist Visa',0.00,0.00,'30 Days','','','<div>1. Hold a biometric passport valid for at least six months with at least one blank visa page</div><div>2. Hold proof of onward and return flights</div><div>3. Hold all documents required for the next destination</div><div>4. Hold proof of sufficient funds relative to your intended length of stay</div><div>5. Confirm with your airline prior to your travel date that boarding will be permitted without a visa</div>'),(189,'Saudi Arabia','Tourist Visa',0.00,0.00,'30 Days','','','1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<div>5. Travel insurance&nbsp;<br>6. Covering letter from applicant<br>7. Hotel voucher<br>8. Bank statement<br>9. Bonafide letter&nbsp;</div>'),(190,'Senegal','Tourist Visa',0.00,0.00,'30 Days','','','1. Passport<br>2. Old passport<br>3. Photo<br><div>4. Air ticket<br>5. Bank statement</div><div>6. Hotel vocuher</div>'),(191,'Serbia','Tourist Visa',0.00,0.00,'30 Days','','','1. Passport<br><div>2. Old passport<br>3. Photo</div><div>4. Air ticket<br>5. Income tax returns<br>6. Travel insurance<br>7. Covering letter of applicants<br>8. Bank statements<br>9. Itinerary<br>10. Hotel vocuher&nbsp;&nbsp;</div>'),(192,'Seychelles','Tourist Visa',0.00,0.00,'30 Days','','','1. Passport<br>2. Air ticket<br>3. Bank statement<div><br><br><br></div>'),(193,'Sierra Leone','Tourist Visa',0.00,0.00,'30 Days','','','<div>1. Passport</div><div>&nbsp; 1.1. With 6 months validity</div><div>&nbsp; 1.2. Must be original and signed</div><div>&nbsp; 1.3. With a blank page for entry stamp</div><div>2. Photographs</div><div>&nbsp; 2.1. 2*2 inches</div><div>&nbsp; 2.2. Must be in color with front view and a plain background</div><div>3. Proof of travel</div><div>&nbsp; 3.1 Requires a copy of your flight itinerary</div><div>&nbsp; 3.2 A copy of your airline ticket showing entry and exit from sierra leone&nbsp;&nbsp;</div>'),(194,'Singapore','Tourist Visa',0.00,0.00,'30 Days','','','1. Passport<br>2. Photo<br>3. Air ticket<br>4. Covering letter from applicant&nbsp;<br>5. Bank statement<br>6. Hotel vocuher<br>'),(195,'Slovakia','Tourist Visa',0.00,0.00,'30 Days','','','1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Travel insurance<br>6. Bank statement<div>7. Income tax returns<br>8. Itinerary<br>9. Hotel voucher<br>10. Covering letter from applicant</div><div>11. Sponsorship letter<br>12. NOC letter from parents to child</div>'),(196,'Slovenia','Tourist Visa',0.00,0.00,'30 Days','','','1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Travel insurance<br>6. Bank statement<br>7. Income tax returns<br>8. Itinerary<br>9. Hotel voucher<br>10. Visa application form<br>11. Covering letter from applicant<div>12. NOC letter from parents to child</div><div>13. Marriage certificate&nbsp;</div>'),(197,'Solomon Islands','Tourist Visa',0.00,0.00,'30 Days ','','','1. Passport<br>2. Photo<br>3. Bank statement<br>4. Air ticket<br>5. Itinerary&nbsp;<br>6. Hotel vocuher&nbsp;'),(198,'Somalia','Tourist Visa',0.00,0.00,'30 Days','','','1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>'),(199,'South Africa','Tourist Visa',0.00,0.00,'30 Days','','','1. Passport<br>2. Old passport<div>3. Photo<br>4. Air ticket<br>5. Yellow fever vaccination&nbsp;<br>6. Visa application form<br>7. Covering letter from applicant<br>8. Bank statement<br>9. Hotel voucher<br>10. NOC letter&nbsp; from parents to child&nbsp;<br>11. Relationship proof<br>12. Itinenary&nbsp;</div>'),(200,'South Georgia And The South Sandwich Islands','Tourist Visa',0.00,0.00,'30 Days','','','<div>1. Visa application form</div><div>2. Passport photo</div><div>3. Passport</div><div>4. Previous passport</div><div>5. Residency proof</div><div>6. Proof of funds&nbsp;</div><div>7. Current details</div><div>8. Travel Itinerary</div><div>9. Hotel bookings</div><div><br></div>'),(201,'Spain','Tourist Visa',0.00,0.00,'30 Days','','','1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Travel insurance<br>6. Bank statement<br>7. Income tax returns<br>8. Itinerary<br>9. Hotel voucher<br>10. Covering letter from applicant<br>11. Copies of all pages of passport<br>12. NOC letter from parents to child&nbsp;<br>13. Marriage certificate&nbsp;'),(202,'Sri Lanka','Tourist Visa',0.00,0.00,'30 Days','','','1. Passport<br>2. Air ticket&nbsp;'),(203,'Sudan','Tourist Visa',0.00,0.00,'30 Days','','','1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Medical report&nbsp;'),(204,'Suriname','Tourist Visa',0.00,0.00,'30 Days','','','1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Travel insurance<br>6. Yellow fever vaccination<div>7. Medical report<br>8. Bank statement</div>'),(205,'Svalbard And Jan Mayen','Tourist Visa',0.00,0.00,'30 Days','','','<div>1. Cover letter from the Application Portal, signed by the applicant. If the applicant is a minor, the</div><div>cover letter must be signed by the parent(s) or legal guardian.</div><div>2. One (1) passport photo, not older than six (6) months, in color with a light background, 35 â€“ 40 mm</div><div>in width.</div><div>3. Passport (both new and old), valid at least three (3) months after the intended date of departure from</div><div>the Schengen area, containing at least two blank pages, and issued within the previous 10 years.</div><div>4. Copy of passport(s) (all used pages including the bio data page)</div><div>5. Original invitation letter dated and signed by the inviter/sponsor in Svalbard/ Spitsbergen, stating</div><div>the purpose and duration of the visit, the relation with the applicant and any other information about</div><div>the applicants visit (not older than three (3) months).</div><div>6. Original Guarantee Form for Visits filled out by the inviter/sponsor in Svalbard and stamped by</div><div>Norwegian authorities + 1 copy (if the applicant does not have sufficient financial means to cover the</div><div>cost of travel).</div><div>7. Copy of inviter/sponsor passport</div><div>8. A valid travel medical insurance for the duration of the intended stay in the Schengen area with a</div><div>minimum coverage of EURO 30.000</div><div>9. Flight booking of roundtrip air ticket to Svalbard (Longyearbyen), and other travels within the</div><div>Schengen area, if applicable. Do not purchase the ticket until a visa has been granted.</div><div>10. Minors (under 18 years of age):</div><div>- student card and/or original letter from the school, mentioning:</div><div>o full address, telephone number(s) of the school</div><div>o name and function of the person giving permission</div><div>o approval for leave of absence</div><div>- Proof of relationship or guardianship.</div><div>- When applicant is travelling alone, or only with one parent: letter of permission to travel signed</div><div>by both parents or legal guardians, and copy of the passport of the parent not travelling.</div><div>11. Letter granting Power of Attorney (optional for applicants who want the sponsor or other person to</div><div>represent them in the case).</div><div>12. If applicable, a written explanation as to why the applicant cannot present any or some of the</div><div>documents</div>'),(206,'Swaziland','Tourist Visa',0.00,0.00,'30 Days','','','<div>1. Passport requirements</div><div>2. Proof of travel arrangements</div><div>3. Special instructions</div>'),(207,'Sweden','Tourist Visa',0.00,0.00,'30 Days','','','1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Travel insurance<br>6. Bank statement<br>7. Income tax returns<br>8. Itinerary<br>9. Relationship proof<br>10. Covering letter from applicants<br>11. Hotel vocuher'),(208,'Switzerland','Tourist Visa',0.00,0.00,'30 Days','','','1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Travel insurance<br>6. Bank statement<br>7. Income tax returns<br>8. Itinerary<br>9. Hotel voucher<br>10. Covering letter from applicant&nbsp;'),(209,'Syrian Arab Republic','Tourist Visa',0.00,0.00,'30 Days','','','1. Passport<br>2. Photo<br>3. Air ticket<br>4. Guarantee letter&nbsp;<br>5. Old passport'),(210,'Taiwan','Tourist Visa',0.00,0.00,'30 Days','','','1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Covering letter from applicant<br>6. Bank statement<br>7. Income tax returns<br>8. Itinenry&nbsp;'),(211,'Tajikistan','Tourist Visa',0.00,0.00,'30 Days','','','1. Passport<br>2. Air ticket<br>3. Photo<br>'),(212,'Tanzania','Tourist Visa',0.00,0.00,'30 Days','','','1. Passport<br><div>2. Photo<br>3. Air ticket<br>4. Yellow fever vaccination<br>5. Covering letter from applicant</div><div>6. Bank statement<br>7. Itinerary&nbsp;</div>'),(213,'Thailand','Tourist Visa',0.00,0.00,'30 Days','','','1. Passport<br>2. Photo<br>3. Air ticket<br>4. Bank statement<br>5. Covering letter from applicant<br>6. Hotel voucher<br>&nbsp;'),(214,'Togo','Tourist Visa',0.00,0.00,'30 Days','','','<div>1. Your passport, with a validity of at least another six months from the end of your stay and at least two blank pages.</div><div>2. Photocopies of the first two pages of your passport.</div><div>3. The Togo visa application form</div><div>4. Two recent passport-size pictures, with the following requirements:</div><div>5. Dimensions: 4.5 x 3.5 cm</div><div>6. White background</div><div>7. Neutral facial expression</div><div>8. Your face and head must be fully visible (headgear only accepted for religious purposes, provided it does not obstruct the face)</div><div>9. Proof you have purchased or booked a return flight ticket.</div><div>10. Travel insurance for the duration of your stay, or proof you have paid a repatriation deposit</div><div>11. Yellow Fever Certificate or the vaccination notebook</div><div>12. Proof of accommodation in Togo, such as a hotel reservation</div>'),(215,'Tokelau','Tourist Visa',0.00,0.00,'30 Days','','','<div>1. Passport validity</div><div>2. Blank visa pages</div><div>3. Tokelau visa application form</div><div>4. Original, signed United State passport</div><div>5. (2) passport photographs</div><div>6. An itinerary of your trip</div><div>7. Proof of yellow fever vaccine</div><div><br></div>'),(216,'Tonga','Tourist Visa',0.00,0.00,'30 Days','','','<div>1. Passport with minimum six months validity beyond intended stay and with two blank pages</div><div>2. 2 Scanned recent colour photograph. (Photo Specification);</div><div>3. Confirmed return flight ticket</div><div>4. Hotel Reservation or Invitation letter (If visiting family or friends)</div><div>5. Updated bank statement of last three months</div><div>6. Invitation letter from the host company (For Business Visa)</div><div>7. Birth Certificate for children</div><div>8. Enough funds to support the entire trip to Tanzania</div>'),(217,'Trinidad And Tobago','Tourist Visa',0.00,0.00,'30 Days','','','<div>1. Hold a Machine Readable passport valid at least six months on entry with one blank visa page</div><div>2. Hold proof of sufficient funds in the form of a bank statement or cash</div><div>3. Hold proof of onward/return airline tickets</div><div>4. Hold documents showing proof of purpose of trip</div><div>5. Hold all documents required for the next destination</div><div>6. Hold a visa for the next destination, if required</div><div>7. Confirm with their airline that boarding will be permitted without a visa as these conditions are subject to change</div>'),(218,'Tunisia','Tourist Visa',0.00,0.00,'30 Days','','','1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>'),(219,'Turkey','Tourist Visa',0.00,0.00,'30 Days','','','1. Passport<div>2. Photo<br>3. Air ticket<br>4. Old passport<br>5. Travel insurance</div><div>6. Income tax returns<br>7. Covering letter from applicants<br>8. Bank statements<br>9. Hotel vocuher&nbsp;</div>'),(220,'Turkmenistan','Tourist Visa',0.00,0.00,'30 Days','','','1. Passport<br>2. Photo<br>3. Air ticket<br>4. Old passport<br>5. Bank statement<div><br></div>'),(221,'Turks And Caicos Islands','Tourist Visa',0.00,0.00,'30 Days','','','<div>1. Hold a passport valid for at least six months beyond your date of country exit and with one blank visa page</div><div>2. Hold proof of onward and return flights</div><div>3. Hold all documents required for the next destination</div><div>4. Hold documents showing proof of travel purpose (e.g. business cover or support letter, conference registrations, etc.)</div><div>5. Hold proof of sufficient funds relative to your intended length of stay</div><div>6. It is recommended that you confirm with your airline that boarding will be permitted without a visa</div>'),(222,'Tuvalu','Tourist Visa',0.00,0.00,'30 Days','','','1. Passport<br>2. Photos<br>3. Air ticket'),(223,'Uganda','Tourist Visa',0.00,0.00,'30 Days','','','1. Passport<br><div>2. Photo<br>3. Air ticket</div>'),(224,'Ukraine','Tourist Visa',0.00,0.00,'30 Days','','','1. Passport<br>2. Photo<br>3. Air ticket<br>4. Old passport<br>5. Travel insurance&nbsp;<br>6. Bank statement<br>7. Income tax returns<br>8. Itineanry&nbsp;&nbsp;'),(225,'United Arab Emirates','Tourist Visa',0.00,0.00,'30 Days','','','<font face=\\\"\\\\\\\\\\\\trebuchet\\\\\\\">1. Passport<br>2. Photo<br>3. Air ticket<br>4. Pan card<br>5. Profession proof</font>'),(226,'United Kingdom','Tourist Visa',0.00,0.00,'30 Days','','','1. Passport<br>2. Old passport<br>3. Photo<div>4. Air ticket<br>5. Covering letter from applicant<br>6. Bank statement&nbsp;</div><div>7. Income tax returns<br>8. Itinerary<br>9. Hotel vocuher&nbsp;<br><br></div>'),(227,'United States','Tourist Visa',0.00,0.00,'30 Days','','','1. Passport<div>2. Old passport<br>3. Photo<br>4. Bank statement</div><div>5. Income tax returns<br>6. Itineanry&nbsp;</div>'),(228,'Uruguay','Tourist Visa',0.00,0.00,'30 Days','','','1. Passport<div>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Credit card</div><div>6. Medical report<br>7. Bank statement</div><div>8. Income tax returns&nbsp;<br>9. Itinerary&nbsp;</div>'),(229,'Uzbekistan','Tourist Visa',0.00,0.00,'30 Days','','','1. Passport<div>2. Photo<br>3. Air ticket<br>4. Hotel voucher</div>'),(230,'Vanuatu','Tourist Visa',0.00,0.00,'30 Days','','','1. Passport<div>2. Photo<br>3. Air ticket<br>4. Hotel vocuher</div>'),(231,'Venezuela','Tourist Visa',0.00,0.00,'30 Days','','','1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Medical report<br>6. Bank statement&nbsp;'),(232,'Vietnam','Tourist Visa',0.00,0.00,'30 Days','','','1. Passport<div>2. Photo<br>3. Air ticket<br><br></div>'),(233,'Virgin Islands','Tourist Visa',0.00,0.00,'30 Days','','','<div>1. Hold a passport valid for at least six months beyond your date of country exit and with one blank visa page</div><div>2. Hold proof of onward and return flights</div><div>3. Hold all documents required for the next destination</div><div>4. Hold documents showing proof of travel purpose (e.g. business cover or support letter, conference registrations, etc.)</div><div>5. Hold proof of sufficient funds relative to your intended length of stay</div><div>6. It is recommended that you confirm with your airline that boarding will be permitted without a visa</div>'),(234,'Wallis And Futuna','Tourist Visa',0.00,0.00,'30 Days','','','<div>1. Original passport with at least 6-month validity.</div><div>2. A scanned copy of passport bio page.</div><div>3. Online visa application forms.</div><div>4. 2 Recent passport-size photos: 35 X 45 mm, white background Matt finish, 80% face size.</div><div>5. Return ticket.</div><div>6. Previous Yemen visa - if applicable.</div><div>7. Original saving bank statements last 6 months updated with a healthy balance.</div><div>8. Enough blank pages in your passport to fit the required entry visa.</div><div>9. Bank Statement.&nbsp; Copies of bank statements from the past 3 months.</div><div>10. Confirmation of round-trip airline ticket or airline ticket to another destination.</div><div>11. Medical travel insurance (Schengen). with a minimum coverage of â‚¬30,000 and validity for all Schengen states.</div><div>12. Employment Letter. A letter from your employer/school (on business letterhead, with contact details), stating that a leave of absence has been granted and that you will be returning to your current job. If you are self-employed, include a copy of your business license and tax return. If you are retired please submit proof of your retirement fund.</div><div>13. Pay Stubs. Copies of 3 most recent pay stubs.</div><div>14. Hotel Reservations. Copy of the Hotel Reservations.</div><div>15. Personal Invitation. If visiting friends or family, you must provide letter of invitation with the contact information of the host and visitor,&nbsp;</div><div>purpose and duration of the visit, confirmation of accommodation including the address, signature and date.&nbsp;</div><div>You will also need to provide proof of the host\\\'s status in Wallis Futuna Islands ie.&nbsp;</div><div>copy of their Wallis Futuna Islands passport\\\'s information page, or, if they are not a citizen of Wallis Futuna Islands,&nbsp;</div><div>copies of their Wallis Futuna Islands residence permit and their national passport\\\'s information pages.</div>'),(235,'Western Sahara','Tourist Visa',0.00,0.00,'30 Days','','','<div>1. Visa Application Form</div><div>2. Passport Photo</div><div>3. Passport</div><div>4. Passport Copy</div><div>5. Residency Proof</div><div>6. Hotel Bookings(Hotel Itinerary)</div><div>7. Flight Bookings</div><div>8. Travel Insurance</div><div>9. Current Details</div><div>10. Invitation Letter</div><div><br></div>'),(236,'Yemen','Tourist Visa',0.00,0.00,'30 Days','','','1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Approval from ministry&nbsp;'),(237,'Zambia','Tourist Visa',0.00,0.00,'30 Days','','','1. Passport<div>2. Photo<br>3. Air ticket<br>4. Yellow fever vaccination</div>'),(238,'Zimbabwe','Tourist Visa',0.00,0.00,'30 Days','','','1. Passport<br>2. Photo<br>3. Air ticket'),(239,'Algeria','Student Visa',3000.00,400.00,'2days','../../uploads//Visa_document_required//2022//Jan//28//1643362222/cache_data.txt','../../uploads//Visa_document_required//2022//Jan//28//1643362178/Way Explorers_Package&amp;Group tourQuotation.pdf','dghd');
